INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(1, 'hoduc17', , 'Sốc! 71% fan Man Utd muốn tiền vệ 40 triệu bảng ra đi', 'àng tiền vệ tưởng như rất chất lượng lại đang là vấn đề của Man Utd.', 'Hàng tiền vệ tưởng như rất chất lượng lại đang là vấn đề của Man Utd.\r\n\r\nCó thể nói, ngoài Paul Pogba, không một tiền vệ nào của Man Utd thật sự xuất sắc. Ở trận đấu với Man City, khi Pogba vắng mặt, những điểm yếu của Quỷ đỏ đã lộ rõ. Tân binh đắt giá Fred thậm chí còn không được ra sân. Ander Herrera và đặc biệt là Nemanja Matic khi được tin dùng đã phải chịu nhiều chỉ trích.\r\n\r\nSốc! 71% fan Man Utd muốn tiền vệ 40 triệu bảng ra đi 0- Matic - Bóng Đá\r\n Matic chơi khá tệ trong mùa này.\r\nTheo The Times, các cầu thủ Man Utd đã đặt câu hỏi với HLV Jose Mourinho khi Người đặc biệt liên tục tin dùng Matic, dù tiền vệ này đang có phong độ kém cỏi.\r\n\r\nSau một mùa bóng ấn tượng ở Old Trafford, Matic đã sa sút thấy rõ khi phải cày ải quá nhiều. Ngôi sao người Serbia tỏ ra chậm chạp, thiếu sức sống và đã không làm tốt nhiệm vụ đánh chặn từ xa cũng như phân phối bóng của mình.\r\n\r\nTrong một cuộc thăm dò được tờ footballfancast đưa ra, có đến 71% fan Quỷ đỏ đồng tình nếu Man Utd bán Matic ngay từ kì chuyển nhượng mùa Đông này.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(2, 'dung29', , 'Lý do Mourinho là \'cái gai\' trong mắt làng túc cầu: Tài năng hơn người, tính cách khác người', 'Mourinho tới nay là HLV bị không ít người trong giới túc cầu tỏ ra ghen ghét.', '5. Tranh luận gay gắt với truyền thông\r\n\r\nMourinho không phải kiểu người hay làm bộ trước ống kính phóng viên. Nói đúng hơn, \'\'Người đặc biệt\'\' chẳng nể nang hay kiêng dè bất cứ điều gì. Chiến lược gia người Bồ Đào Nha thường tỏ ra cáu kỉnh và sẵn sàng đáp trả dư luận một cách gay gắt. Công bằng mà nói, đây không phải là tính cách xấu của cựu HLV Chelsea. Song, việc ông kéo các học trò lẫn đội nhà để chỉ trích công khai khiến người hâm mộ khó lòng chấp nhận.\r\n\r\n5 lý do khiến Mourinho trở thành cái gai của làng túc cầu: - Bóng Đá\r\nMourinho thích tranh cãi với truyền thông và kéo theo cả các học trò.\r\nTất cả đều nằm trong giới hạn và Mourinho dường như không hiểu được điều đó. Từ Real, Chelsea và giờ là Manchester United, các ngôi sao lần lượt trở thành tấm bia đỡ đạn cho những sai lầm của nhà cầm quân 55 tuổi. Eden Hazard, Paul Pogba và thậm chí cả Cristiano Ronaldo đều phải đối mặt với cơn thịnh nộ từ ông trước giới truyền thông.\r\n\r\n4. Lối đá tiêu cực\r\n\r\nNếu là cổ động viên làng túc cầu, mọi người đều sẽ nghe đến thuật ngữ \"dựng xe buýt\". Và Mourinho chính là HLV hiểu và áp dụng lối đá này thành công hơn cả. Chiến thuật phòng thủ của chiến lược gia người Bồ Đào Nha giúp ông gầy dựng thương hiệu và giành những danh hiệu danh giá ở Chelsea, Inter, Real Madrid và MU.\r\n\r\nThế nhưng, trong giới bóng đá, một chiến thuật cũng có hạn sử dụng. Và hiện tại, chẳng còn bao nhiêu người mặn mà, hứng thú với cách thi đấu này. Ở Manchester United, lối đá tiêu cực của \"Người đặc biệt\" chẳng những khiến các siêu sao không phát huy hết tài năng mà còn biến CLB trở thành đội bóng lạc hậu, đánh mất bản sắc. 10 người đứng sau 1 trái bóng, dù thế nào đi nữa, đó cũng không phải thứ bóng đá mà khán giả muốn xem.\r\n\r\n3. Chuyển nhượng tệ hại\r\n\r\nKhi không có được những gì mong muốn, Mourinho trở thành người đàn ông gắt gỏng và kẻ làm loạn. Như kỳ chuyển nhượng hè 2018, Ban lãnh đạo MU cương quyết từ chối các mục tiêu của \'\'Người đặc biệt\". Thế là, cựu HLV Real thẳng thừng mỉa mai thượng tầng CLB.\r\n\r\nNhưng thật sự, \"Quỷ đỏ\" có lý do để quyết định như vậy. Chưa đầy 3 năm ở Old Trafford, Mou chi cả nửa tỷ euro để mua sắm cầu thủ. Những ngôi sao như Victor Lindelof và Eric Bailly đều rất bình thường. Ngay cả bom tấn Pogba, Lukaku cũng đánh mất chính mình. Rõ ràng, nhà cầm quân 55 tuổi không biết ngôi sao nào phù hợp với đội nhà cũng như tìm cách để giúp đỡ họ.\r\n\r\n2. Cái tôi lớn hơn CLB\r\n\r\nKhi gặp phải rắc rối hay phạm phải sai lầm, thay vì giữ im lặng, Mourinho càng mạnh mẽ đối đầu với truyền thông. Tiếc là, \"Người đặc biệt\" là dùng cách tiêu cực để giải quyết. Ông không nhận lỗi, không biết đâu đúng sai mà chỉ đổ lỗi về tất cả để bảo vệ bản thân.\r\n\r\n5 lý do khiến Mourinho trở thành cái gai của làng túc cầu: - Bóng Đá\r\n Cái tôi của Mou quá lớn.\r\nCái tôi của Mou quá lớn, ông luôn muốn được ca tụng, khen ngợi. Đó là lý do tại sao cựu thuyền trưởng Inter khoe những thành tích quá khứ. Và rồi không những không cùng các học trò, đội nhà đồng cam cộng khổ, ông còn mắng chửi học trò và chỉ trích CLB.\r\n\r\n1. Thành công rực rỡ\r\n\r\nCuối cùng, phải công nhận một điều rằng, Mourinho thuộc top những HLV thành công bậc nhất làng túc cầu. Chiến lược gia người Bồ Đào Nha cùng Porto, Inter, Chelsea và cả Real nhiều lần giành tất thảy các danh hiệu cao quý. Cộng thêm cá tính mạnh, thẳng thắn, ông chưa bao giờ khiêm tốn về tài năng bản thân. Vì vậy, mọi người ghen tị và ghét luôn những gì mà \"Người đặc biệt\" đạt được.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(4, 'dung29', , 'Thật may vì Arsenal không bán tôi\'', 'Alexandre Lacazette có những trải lòng về mối lương duyên với Arsenal.', 'Sau rất nhiều đồn đoán, Arsenal cũng đem Alexandre Lacazette về thành công từ Lyon. Trước đó từng có tin rằng tiền đạo người Pháp liên tục từ chối \"Pháo thủ\", và sự thật đúng là như vậy.\r\n\r\n - Bóng Đá\r\n Lacazette đang là cầu thủ chơi hiệu quả nhất tại Arsenal.\r\n\"Trước khi chính thức gia nhập Arsenal, mùa hè 2016 tôi đã đàm phán với Arsenal. Tuy nhiên, đó không phải là thời điểm tốt để sang Anh, và khi họ trở lại tìm tôi, tôi đã nghĩ họ thực sự cần mình, mọi chuyện sau đó diễn ra rất suôn sẻ.\"\r\n\r\n\"Tôi hạnh phúc vì được chơi tại giải đấu này (Premier League) với những đồng đội mới. Thật mừng là mùa hè vừa qua Arsenal đã không bán tôi đi, họ nói rất vui vì có tôi xuất hiện trong đội bóng.\"\r\n\r\nQuyết định giữ Lacazette đến lúc này của Unai Emery là hoàn toàn đúng đắn. Cùng với Aubameyang, bộ đôi này trở thành cặp song sát lợi hại trên hàng công Arsenal. Theo thống kê từ WhoScored, không cầu thủ nào tại Emirates đang thi đấu tốt hơn tiền đạo người Pháp.\r\n\r\nAnh luôn biết tỏa sáng trong những thời khắc quan trọng, tiêu biểu như bàn gỡ hòa quý giá vào lưới Liverpool để giữ lại 1 điểm cho Arsenal.', 'Anh', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(5, 'hoduc17', , 'Vì vụ Coutinho, đến lúc này Barca vẫn còn là \"con nợ\"', 'Philippe Coutinho đã là người của xứ Catalan từ hồi tháng Giêng, thế nhưng cho đến lúc này Barca vẫn còn nợ Liverpool một khoản tiền không nhỏ.', 'Như đã biết, Barcelona đã phải chi trả số tiền khổng lồ 106 triệu bảng nhằm đưa Philippe Coutinho về Camp Nou. Không những thế, gã khổng lồ xứ Catalan còn phải chấp nhận không được mua thêm bất kỳ cầu thủ nào của Liverpool trong vòng 2 năm tới (hết hiệu lực vào năm 2021). Rõ ràng với động thái này, đại diện nước Anh đã rút ra được một bài học xương máu sau khi liên tục bị \"rút ruột\".\r\n\r\nThế nhưng đó chưa phải là toàn bộ của câu chuyện. Theo đó, lúc này nhà ĐKVĐ La Liga vẫn còn đang nợ The Kops số tiền 36 triệu bảng. Tuy nhiên, Liverpool đã chấp nhận cho phía Barca tiến hành trả góp trong thời gian Coutinho thi đấu tại Tây Ban Nha. Cứ mỗi khi Coutinho chạm mốc 25 lần ra sân, Blaugrana sẽ mất cho The Kops số tiền 4,4 triệu bảng.\r\n\r\nHow much Barcelona still owe Liverpool for Philippe Coutinho revealed - Bóng Đá\r\nLúc này Barca vẫn chưa trả hết nợ cho Liverpool.\r\nNgoài ra, cứ mỗi năm Barca được tham dự Champions League, họ cũng sẽ mất khoản tiền tương tự là 4,4 triệu bảng. Và số tiền này sẽ nhân đôi nếu ông lớn xứ Catalan vô địch. Lúc này tiền vệ người Brazil có 29 lần ra sân, điều này đồng nghĩa với việc Lữ đoàn đỏ đã nhận được số tiền từ lần chi trả đầu tiên.\r\n\r\nQuay trở lại với điều khoản trên, như vậy là Jurgen Klopp đã có thể tạm thời \"kê cao gối mà ngủ\" trước sự dòm ngó của Barca, dẫu vậy một đội bóng khác vẫn đang lo ngay ngáy vì CLB áo xọc đỏ lam, đó là Tottenham Hotspur khi mới đây đích thân Lionel Messi đã lên tiếng yêu cầu thượng tầng Camp Nou chiêu mộ trụ cột của Lilywhites là Christian Eriksen.', 'Anh TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(6, 'dung29', , 'Bán Dembele lúc này, Barca sẽ \"mất trắng\" \"Pellegrini\"', 'Nếu để Ousmane Dembele rời Camp Nou lúc này, Barca sẽ phải lập tức trả nốt số tiền 26 triệu bảng cho Borussia Dortmund.', 'Mới đây, tờ Die Welt đã tiết lộ Barcelona sẽ phải lập tức hoàn thành chi trả số tiền 131 triệu bảng cho Borussia Dortmund nếu như họ để Ousmane Dembele ra đi trước thời hạn kết thúc hợp đồng vào năm 2022. Theo đó, hồi hè năm ngoái đại diện nước Đức mới chỉ nhận vệ số tiền 96 triệu bảng, còn số tiền phụ thu 35 triệu bảng vẫn đang được Barcelona trả trong quá trình Dembele chơi bóng tại Catalan.\r\n\r\nLúc này, CLB áo sọc đỏ lam đã mất cho Dortmund 9 triệu bảng, trong đó có một nửa vì Dembele đã đạt cột mốc 25 lần ra sân, nửa còn lại là bởi Barca đã giành được tấm vé tham dự Champions League. Rõ ràng, Barcelona không sở hữu tiềm lực tài chính quá mạnh như Manchester United hay Paris Saint Germains, bởi thế việc được trả góp số tiền phụ thu - còn lại 26 triệu bảng chưa thanh toán, tức tương đương với số tiền phá vỡ hợp đồng của Lorenzo Pellegrini - là một lợi ích tương đối lớn mà đội chủ sân Camp Nou nhận được từ thương vụ Dembele.\r\n\r\nBarcelona \'face paying full £131m fee for Ousmane Dembele if they sell the winger before the end of his contract\' - Bóng Đá\r\nBarca sẽ phải lập tức thanh toán số tiền 26 triệu bảng cho Dortmund nếu bán Dembele lúc này.\r\nVề phía tiền đạo 21 tuổi, hiện tại anh đang trải qua quãng thời gian khá đen tối trong sự nghiệp. Chẳng những vắng mặt trong chiến thắng của ĐT Pháp trước Uruguay rạng sáng hôm nay, anh còn đang \"không hạnh phúc\" tại Camp Nou. Truyền thông Catalan thời gian qua thậm chí còn đưa tin Dembele nếu không nhanh chóng cải thiện có thể sẽ bị đẩy đi. Tuy nhiên nếu viễn cảnh này xảy ra, đây sẽ là một cú sốc tài chính lớn với nhà ĐKVĐ La Liga, nhất là khi vì thương vụ mang tên Philippe Coutinho, họ vẫn đang là \"con nợ\" của The Kops.\r\n\r\nCả Arsenal lẫn Liverpool đều muốn chiêu mộ Dembele, thế nhưng không ai trong số hai đại diện của xứ sở sương mù sẵn sàng bỏ ra số tiền mà Barca đã phải chi ra để có được anh.', 'TBN Duc', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(7, 'dung29', , 'Xong: PSG cúi đầu thương vụ Rabiot', 'Mới đây, truyền thông nước Pháp đưa tin về quyết định của PSG về tương lai Rabiot.', 'Sau thời gian có vẻ im ắng, cái tên Rabiot tiếp tục náo loạn làng túc cầu. Liên tiếp những ngày qua, truyền thông Tây Ban Nha không ngừng cập nhật tin tức liến quan đến tương lai tuyển thủ người Pháp ở PSG. Theo tờ Sport.es, cuộc chiến dai dẳng giữa cả 3 đang đi đến hồi kết. Cả Barca và PSG đều gấp rút hoàn tất mọi thủ tục để sớm chốt thương vụ trên.\r\n\r\nXong: PSG cúi đầu thương vụ Rabiot - Bóng Đá\r\n PSG muốn bán Rabiot.\r\nTrong khi đó, về phía Mundo Deportivo, tờ báo tiết lộ ngôi sao 23 tuổi đã thông báo với Ban lãnh đạo \"Blaugrana\" anh đồng ý chuyển đến Camp Nou. Thời điểm là vào ngày 1/7/2019 khi tiền vệ số 25 kết thúc hợp đồng với PSG và ra đi theo dạng tự do.\r\n\r\nMới đây, báo chí nước Pháp tiếp tục cập nhật tin tức từ sân \"Công viên các Hoàng tử\". Cụ thể, tờ Le Parisien cho biết trước tình thế khó khăn và sự kiên quyết của Rabiot, Ban lãnh đạo đại diện Paris không còn nhiều cơ hội để thuyết phục anh. Theo đó, Giám đốc thế thao CLB, Antero Henrique sẽ sớm lên kế hoạch bán tiền vệ số 25 ngay trong kỳ chuyển nhượng mùa đông để thu về 1 khoản tiền vừa phải.\r\n\r\nĐiều này cũng đồng nghĩa, sau thời gian cố gắng chèo kéo, đương kim vô địch Ligue 1 cũng đành chấp nhận đầu hàng Rabiot. Theo Mundo Deportivo, hàng động của PSG vừa muốn kiềm tiền vừa muốn gây khó dễ cho Barca.  Đội bóng sẽ mở cửa cho nhiều người tham gia và chỉ chấp nhận bán cho CLB nào trả số tiền cao, hợp lý.', 'TBN Phap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(8, 'hoduc17', , 'Ở lại Chelsea hay về với Real, sao 24 tuổi đã có câu trả lời', 'Ngôi sao hiện đang khoác áo The Blues chính thức lên tiếng về tương lai của mình.', 'Mateo Kovacic gia nhập Chelsea hè qua, theo bản hợp đồng cho mượn có thời hạn một năm từ Real Madrid. Dù vẫn phải vướng vào cuộc cạnh tranh vị trí với Ruben Loftus-Cheek hay Ross Barkley cho suất thứ 3 trong hàng tuyến giữa 3 người cùng N\'Golo Kante và Jorginho, nhưng nhìn chung, anh vẫn có nhiều thời gian góp mặt hơn thời ở Santiago Bernabeu.\r\n\r\nTrong bài phỏng vấn mới đây với Marca, Kovacic đã thổ lộ ý muốn tương lai của mình. Theo đó, tiền vệ 24 tuổi mong muốn tiếp tục được ở lại Tây London sau khi kết thúc mùa giải hiện tại.\r\n\r\nKovacic muốn ở lại Chelsea - Bóng Đá\r\n Kovacic muốn gắn bó lâu dài với The Blues.\r\n\"Tôi muốn được hạnh phúc và tại Chelsea, tôi đang cảm thấy thế.\" Kovacic chia sẻ. \"Tôi chỉ muốn được ra sân trong các trận đấu, nhận lãnh trách nhiệm trong đội bóng. Đó là những gì tôi tìm thấy ở Chelsea lúc này.\"\r\n\r\n\"Đây không phải là lúc bàn về những chuyện khác ngoài chơi bóng và tận hưởng từng phút trên sân. Tôi không muốn nghĩ về những gì sẽ xảy ra. Tôi chỉ muốn được thi đấu hàng tuần.\" \r\n\r\nRạng sáng mai, Kovacic nhiều khả năng sẽ góp mặt trong đội hình xuất phát của Croatia đối đầu tuyển Anh, trong trận đấu quyết định vé đi tiếp ở nhóm A UEFA Nations League.', 'Anh TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(9, 'dung29', , 'Đồng đội tin Ronaldo đủ sức \'cày\' tới 40 tuổi', 'Trung vệ Giorgio Chiellini tin rằng với tố chất của mình, Cristiano Ronaldo hoàn toàn có thể tiếp tục thi đấu ở các giải đình cao đến năm 2020.', 'Cụ thể Giorgio Chiellini, người năm nay cũng đã 34 tuổi, chia sẻ rằng: \"Vâng, chúng tôi hoàn toàn có đủ khả năng để thi đấu đến năm 40 tuổi, mặc dù tôi không rằng mình sẽ chơi lâu đến vậy.\"\r\n\r\nĐồng đội tin Ronaldo đủ sức \'cày\' tới 40 tuổi  - Bóng Đá\r\n Liệu Ronaldo có tiếp tục thi đấu đến năm 40 tuổi?\r\n\"Điều này không phải chỉ vì Ronaldo luôn là người đến sân tập đầu tiên, mà chính cách mà anh ấy tập luyện mới là điều tạo nên sự khác biệt. Anh ấy luôn thúc đẩy bản thân.\"\r\n\r\n\"Anh ấy là một người rất thông minh. Anh ấy tới một giải đấu và quốc gia rất khác biệt, tuy nhiên đã rất nhanh chóng nỗ lực tìm kiếm những điểm nổi bật ở đây.\"\r\n\r\nThực tế theo các báo cáo kiểm tra sức khỏe mà Juventus có được hồi đầu mùa giải năm nay, khả năng Ronaldo tiếp tục chơi bóng thêm nhiều năm nữa là điều hoàn toàn có thể xảy ra khi thể trạng hiện tại của CR7 chẳng khác nào một chàng trai chỉ ở tuổi đôi mươi.\r\n\r\nBản thân Ronaldo trong mùa giải năm nay cũng đã cho thấy rằng anh vẫn chưa hề già, khi đã ghi được tới 8 bàn và 5 pha kiến tạo trong 12 lần ra sân trong màu áo Juventus.', 'Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(10, 'hoduc17', , 'Cha của David Ospina khẳng định Napoli muốn giữ anh lại', 'Màn trình diễn của thủ môn người Colombia đã thuyết phục BLĐ Napoli giữ lại anh.', 'Mùa hè vừa qua, David Ospina chuyển từ Arsenal sang Napoli theo dạng cho mượn với thời hạn một năm. Trong bản hợp đồng có chi tiết rằng nếu thủ thành này ra sân từ 30 trận trở lên cho đội chủ sân San Paolo, Napoli sẽ có quyền mua đứt anh, và diễn biến gần đây cho thấy họ thực sự muốn làm điều đó.\r\n\r\n - Bóng Đá\r\n David Ospina chơi rất ổn định trong màu áo Napoli.\r\nCha của David Ospina, ông Hernan cho biết: \"Vâng, tôi đã nghe rất nhiều về chuyện đó (Napoli muốn gia hạn với Ospina) từ giới truyền thông.\"\r\n\r\n\"Napoli muốn giữ Ospina bất chấp con số 30 trận đấu có diễn ra hay không. Nó hiện đang hạnh phúc, đang chơi rất tốt cùng toàn đội và hiện ở trong CLB hàng đầu tại Italia.\"\r\n\r\n\"Ospina thường gọi cho tôi trước mỗi trận đấu. Nó rất chuyên nghiệp và tận tụy với công việc của mình. Nó hy sinh bản thân của mình vì tập thể, và còn là cậu bé tuyệt vời luôn cống hiến hết mình cho Naples.\"\r\n\r\nTính đến thời điểm này, thủ môn người Costa Rica đã ra sân tổng 11 trận cho đội chủ sân San Paolo. Và với những gì đang thể hiện, việc Napoli muốn gia hạn với Ospina cũng không phải điều gì quá ngạc nhiên.', 'Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(11, 'hoduc17', , 'Góc PSG: Sự bất lực của núi tiền Qatar', ' Tiền của các ông chủ Qatar đã giúp cho PSG giải quyết được rất nhiều vấn đề, nhưng lúc này thì có cả núi tiền thì cũng chẳng giúp được các nhà ĐKVĐ nước Pháp.', 'Kết thúc loạt trận giao hữu quốc tế vào đêm qua, PSG đã liên tục nhận 2 hung tin trời giáng từ các trận đấu giữa Brazil - Cameroon và Pháp - Uruguay. Cụ thể từ trước khi tiếng còi chung cuộc của trọng tài vang lên, bô đôi ngôi sao chủ lực trên hàng công của PSG là Neymar và Mbappe đều đã gục ngã xuống sân trong đau đớn.\r\n\r\nGóc PSG: Cái tát cho núi tiền từ Qatar - Bóng Đá\r\n PSG đã nhận liên tiếp 2 hung tin trong loạt trận giao hữu đêm qua.\r\nCả Neymar lẫn Mbappe đều sẽ được tiến hành kiểm tra trong 24 giờ nữa trước khi kết quả chẩn đoán cuối cùng về chấn thương được công bố. Trong trường hợp xấu nhất có thể xảy ra, giới quan sát lo sợ rằng bộ đôi này có thể sẽ không kịp trở lại trong trận đấu cực kỳ quan trọng với Liverpool diễn ra tại Công Viên Các Hoàng Tử vào tuần sau.\r\n\r\nĐó là trận đấu mang tính chất \'sống còn\' của PSG tại Champions League, vì chỉ cần thất bại thì coi như cánh cửa vượt qua vòng bảng của các nhà đương kim vô địch nước Pháp sẽ khép lại. Cụ thể vào thời điểm hiện tại, PSG chỉ đang xếp thứ 3 với chỉ 5 điểm. Trong khi đó Liverpool và Napoli đều đang có cùng 6 điểm. Nếu thua, PSG sẽ kém Liverpool tới 4 điểm và khả năng cao đây cũng sẽ là khoảng cách với Napoli (đội bóng chỉ phải đối đầu với đối thủ chót bảng đấu là FK Crvena Zvezda). Khi đó 1 trận đấu còn lại của vòng bảng rõ ràng không đủ để PSG giành quyền đi tiếp.\r\n\r\nHãy nhớ rằng với các ông chủ Qatar, Champions League mới chính là đấu trường mà họ muốn chính phục nhất, chứ không phải là việc bảo vệ ngôi vương tại Ligue 1. Đó cũng chính là lý do họ đã chấp nhận bỏ ra gần 300 triệu euro chỉ để chiêu mộ Neymar và Mbappe vào đầu mùa giải năm ngoái.\r\n\r\nGóc PSG: Cái tát cho núi tiền từ Qatar - Bóng Đá\r\n Nếu không thể thắng được Liverpool, khả năng PSG bị loại khỏi Champions League là rất lớn.\r\nCũng vì khát khao được chạm tay vào chiếc cúp bạc danh giá tại Champions League, PSG hiện cũng đang bị UEFA điều tra gắt gao về tình trạng tài chính của đội bóng. Cụ thể cơ quan quyền lực nhất châu Âu nghi ngờ PSG đã có những hành vi vi phạm luật công bằng tài chính, và nếu tìm ra bằng chứng thì đội chủ sân Công Viên Các Hoàng Tử hoàn toàn có thể bị cấm chuyển nhượng, thậm chí là cấm thi đấu tại Champions League.\r\n\r\nNếu viễn cảnh này thật sự xảy ra, gần như sẽ có một cuộc tháo chạy rất lớn sẽ diễn ra. Đến lúc này có thể núi tiền của PSG cũng bất lực trong việc giữ chân được những ngôi sao như Neymar, Mbappe,... ở lại đội bóng. Lúc đó rõ ràng những kế hoạch mà họ đã vạch ra cách đây 2 năm sẽ chính thức phá sản.', 'C1 Phap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(12, 'dung29', , '5 ngôi sao trẻ xuất sắc nhất thế giới hiện tại: Đã hiểu vì sao Dortmund trở lại ấn tượng', 'Làng túc cầu đang chứng kiến sự nổi lên của hàng loạt ngôi sao trẻ tài năng.', '5. Kai Havertz (Bayer Leverkusen)\r\n\r\nNăm 2009, Kai Havertz từng về nhì ở cuộc bầu chọn cầu thủ U17 hay nhất nước Đức. 1 năm sau, ngôi sao số 29 gia nhập đội trẻ Bayer Leverkusen khi mới 11 tuổi. Với việc ra mắt đội 1 CLB vào ngày 15/10/2016, tuyển thủ sinh năm 1999 trở thành cầu thủ trẻ nhất khoác áo đội nhà tại Bundesliga.\r\n\r\nThe 5 best teenagers in world football currently - Bóng Đá\r\nKai Havertz thi đấu ngày càng tiến bộ.\r\nChưa dừng lại ở đó, anh còn lập thành tích cầu thủ trẻ nhất nhất ghi bàn cho Leverkusen ở giải đấu số 1 nước Đức. Ở đội tuyển quốc gia, Havertz từng chơi bóng ở các đội U16, U17 và U19 Đức. Ngôi sao 19 tuổi đã có tổng cộng 30 trận và ghi được 9 bàn.\r\n\r\nỞ mùa giải 2017/2018, Havertz có màn trình diễn vô cùng ấn tượng. Thế nhưng, hiện tại, tiền vệ số 29 đã tự đưa tài năng bản thân lên tầm cao mới. Sau 14 trận đấu trên mọi đấu trường, tuyển thủ người Đức bỏ túi 6 bàn thắng và 4 kiến tạo. Quan trọng hơn, anh đang chơi tốt ở vị trí số \'\'10\'\' và trở thành trái tim nơi tuyến giữa CLB. Trong tương lai, ngôi sao 19 tuổi có thể trở thành người kế thừa Ballack và Ozil ở tuyển quốc gia.\r\n\r\n4. Dan-Axel-Zagadou (Borussia Dortmund)\r\n\r\nDưới thời HLV Lucien Favre, Zagadou thi đấu với bộ mặt vô cùng xuất sắc. Tuyển thủ người Pháp hiện là bức tường chắc chắn bậc nhất Bundesliga dù chỉ mới 19 tuổi. Các thống kê chỉ ra rằng, ngôi sao số 2 không ngừng tiến bộ từng ngày. Tới nay, trung vệ sinh năm 1999 đạt thành tích giữ sạch lưới đội nhà trung bình 6 lần 1 trận, 2.6 lần thu hồi bóng thành công.\r\n\r\nChưa kể, khả năng kiểm soát bóng của Zagadou cũng rất ấn tượng, 74.7%/1 trận. Trong khi đó, tỉ lệ chuyền bóng chính xác hơn 87.5%. Quan trọng hơn, ngôi sao người Pháp góp công lớn trong kết quả tuyệt vời của Dortmund tại Bundesliga và Champions League.\r\n\r\n3. Jadon Sancho (Borussia Dortmund)\r\n\r\nLựa chọn Bundesliga thay vì Premier League, Sancho đang chứng tỏ với thế giới quyết định của bản thân hoàn toàn đúng đắn. Dưới sự dẫn dắt của HLV Lucien Favre, ngôi sao người Anh chỉ được sử dụng như quân bài dự bo. Song, tiền vệ số 7 không ngừng tỏa sáng.\r\n\r\nThe 5 best teenagers in world football currently - Bóng Đá\r\n Sancho thi đấu ổn định dù là con bài dự bị.\r\nHiện tại, Sancho đã bỏ túi 4 bàn thắng cùng 6 đường chuyền thành bàn. Cầu thủ 18 tuổi còn nằm trong top 5 chân kiến đạo hàng đầu châu Âu tính tới nay. Phong độ ấn tượng của tài năng trẻ người Anh giúp Dortmund đang dẫn đầu ở Bundesliga.\r\n\r\n2. Matthijs De Ligt (Ajax)\r\n\r\nDe Ligt là cầu thủ trưởng thành từ lò đào tạo của Ajax. Tuyển thủ người Hà Lan nhanh chóng để lại dấu ấn ở đội trẻ CLB. Hậu vệ số 3 ra mắt đội 1 năm 2016 và ngày càng trưởng thành, tiến bộ trong màu áo đội nhà.\r\n\r\nKhông những vậy, ở tuổi 18, De Ligt đã được chơi trận đầu tiên trong màu áo đội tuyển quốc gia. Đây là vinh hạnh với ngôi sao sinh năm 1999 khi trở thành cầu thủ trẻ nhất từng chơi cho ĐT Hà Lan kể từ sau Mauk Weber năm 1931.\r\n\r\nDe Ligt có chiều cao 1m88, sở hữu những tố chất của một trung vệ hàng đầu, có khả năng không chiến tốt, chọn vị trí hoàn hảo và cũng rất thông minh trong những tình huống tranh chấp. Cầu thủ người Hà Lan thuận cả hai chân và hoàn toàn có thể thi đấu tốt ở hàng tiền vệ với khả năng thu hồi bóng.\r\n\r\n1. Kylian Mbappe (Paris Saint-Germain)\r\n\r\nKhông quá khó hiểu khi Mbappe dẫn đầu danh sách các cầu thủ xuất sắc nhất thế giới thời điểm hiện tại. Chức vô địch World Cup cùng màn trình diễn tuyệt vời tại đấu trường thế giới, ngôi sao PSG làm được điều mà bao nhiêu danh thủ mơ ước dù mới 19 tuổi.\r\n\r\nThe 5 best teenagers in world football currently - Bóng Đá\r\nMbappe vẫn đang thi đấu xuất sắc.\r\nHiện tại, tiền đạo số 10 là trụ cột quan trọng của đương kim vô địch Ligue 1. Sau 12 vòng đấu, tuyển thủ người Pháp có 11 bàn thắng và 4 kiến tạo cho đội nhà ở giải quốc nội. Chưa kể, anh cũng bỏ túi thêm 2 bàn ở Champions League. Chưa kể, Mbappe đang dẫn đầu danh sách cuộc đua \"Chiếc giày vàng châu Âu\".', 'Phap Duc C1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(13, 'hoduc17', , 'Đạt xong thỏa thuận, Ibrahimovic chốt ngày trở lại Italia', 'Theo La Gazzetta dello Sport, Zlatan Ibrahimovic đã đạt được những điều khoản cơ bản trong việc trở lại đầu quân cho AC Milan.', 'Lời đề nghị mà AC Milan dành cho Ibra tạm thời là một bản hợp đồng ngắn hạn trong vòng 6 tháng. Tuy nhiên trong đó cũng có bao gồm những điều khoản cho phép gia hạn thêm 1 năm dựa vào những thành tích mà tiền đạo người Thụy Điển đạt được trên sân cỏ.\r\n\r\nĐạt xong thỏa thuận, Ibrahimovic chốt ngày trở lại Italia - Bóng Đá\r\n Ibra đang trên đường trở lại AC Milan.\r\nTheo La Gazzetta dello Sport, cơ bản thì Ibra và Milan đã thống nhất xong các điều khoản và nhiều khả năng tiền đạo 37 tuổi này sẽ lập tức trở lại Italia để hoàn tất những thủ tục còn lại sau khi TTCN chính thức mở cửa trở lại vào tháng Giêng 2019.\r\n\r\nViệc Ibra trở lại hứa hẹn sẽ mở ra một cuộc cạnh tranh rất dữ dội cho vị trí trung phong cắm của Milan trong giai đoạn còn lại của mùa giải. Hiện Higuain đang là cầu thủ được HLV Gattusso tin tưởng giao cho một suất đá chính, nhưng phong độ mờ nhạt thời gian qua của cựu tiền đạo Juventus có thể khiến anh bị đánh bật lên băng ghế dự bị bất cứ lúc nào.\r\n\r\nTrái với Higuain, Ibra lại vừa trải qua một năm đầy thành công trong màu áo LA Galaxy tại MLS. Cụ thể ngay trong mùa đầu tiên tới Mỹ chơi bóng, Ibra đã có tổng cộng 22 bàn thắng cùng 10 đường kiến tạo sau 27 lần ra sân, qua đó giành luôn giải thưởng \'tân binh của năm\' ở giải đấu này.', 'CN Italy', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(14, 'dung29', , 'Tin nhanh 22/11: M.U mất toi 300 triệu; Real giật thương vụ kép 90 triệu', 'cập nhật thông tin nhanh về những sự kiện mới nhất của làng túc cầu.', 'Rafinha quyết tìm đường rời Barca. Cha và cũng là người đại diện của Rafinha, ông Mazinho, nói rằng cầu thủ người Brazil cần phải rời Barca để tìm kiếm cơ hội ra sân nhiều hơn.\r\n\r\nTin nhanh 22/11:  - Bóng Đá\r\n Man United sụt giảm nghiêm trọng.\r\n\"Neymar sai lầm khi tới PSG\". Cựu tiền vệ của Barca và ĐT Brazil, Edmilson cho rằng Neymar đã sai lầm khi từ bỏ Barca để tới PSG. Theo Edmilson, nếu quyết định gắn bó với sân Camp Nou, Neymar sẽ có cơ hội tốt hơn để trở thành ngôi sao số 1 thế giới.\r\n\r\nJuan Mata chưa vội gia hạn hợp đồng với M.U. Theo tờ ESPN tiết lộ, Juan Mata chưa đặt bút ký vào bản hợp đồng mới với M.U, bất chấp bản hợp đồng của anh với Quỷ đỏ chỉ còn thời hạn tới hè năm 2019.\r\n\r\nArsenal muốn chiêu mộ \"hàng thừa\" Liverpool. Hiện tại, ngoài Monreal, Unai Emery đang nắm trong tay Sead Kolasinac, Ainsley Maitland-Niles cùng Granit Xhaka là những cái tên có thể thi đấu ở cánh trái. Thế nhưng theo The Mirror, đội bóng thành bắc London đang nhắm tới Alberto Moreno nhằm dự phòng cho trường hợp Monreal rời Emirates.\r\n\r\nMan Utd mất 300 triệu bảng. Sàn giao dịch chứng khoán New York đã chứng kiến sự sụt giảm giá trị rất lớn của Man Utd vào ngày 20/11 vừa qua. Theo đó, mỗi cổ phiếu của Quỷ đỏ đã rớt giá từ 15,58 bảng xuống chỉ còn 14,22 bảng. Đây là sự sụt giảm nghiêm trọng nhất của Man Utd kể từ tháng 10/2017. Tính ra, tổng giá trị của Quỷ đỏ đã mất hơn 300 triệu bảng.\r\n\r\nReal Madrid 1 lúc giật 2 thương vụ cực chất? Real Madrid đang lên kế hoạch chiêu một cùng lúc 2 tân binh đến từ Premier League. Nguồn tin từ Mirror tiết lộ, Real Madrid sẵn sàng chi 50 triệu bảng cho Marcus Rashford và 40 triệu bảng cho Christian Eriksen.', 'Anh CN Phap Duc TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(15, 'dung29', , 'Barcelona: Muốn trở lại Nou Camp, Neymar phải đáp ứng 2 điều kiện', 'Barcelona đã đưa ra 2 điều kiện không hề dễ dàng cho Neymar nếu muốn trở về Nou Camp.', 'Trong những ngày vừa qua, thông tin Neymar sẽ rời Paris Saint-Germain và quay về xứ Catalunya đang là chủ đề được bàn tán nhiều nhất trên các mặt báo.\r\n\r\nDù vẫn đang thể hiện một phong độ ấn tượng ở nước Pháp với 13 bàn thắng cùng 6 đường kiến tạo, thế nhưng, cuộc sống của ngôi sao người Brazil đang được đồn đoán không mấy dễ chịu, đặc biệt với mối quan hệ \"cơm không lành, canh chẳng ngọt\" với trung phong Edinson Cavani.\r\n\r\nDo đó, tờ Daily Star đã đưa ra thông tin cho rằng Neymar đang suy xét đến việc rời sân \"Công viên các hoàng tử\" để trở về Nou Camp khoác áo Barcelona.\r\n\r\nDù vậy, theo cập nhật mới nhất từ tờ Mirror, phía Blaugrana đã đưa ra 2 điều kiện không dễ đáp ứng đối với Neymar nếu anh muốn về Catalunya thi đấu.\r\n\r\nBarcelona: Muốn trở lại Nou Camp, Neymar phải đáp ứng 2 điều kiện - Bóng Đá\r\nLiệu Neymar có trở về Barcelona? \r\nĐiều kiện thứ nhất, ngôi sao người Brazil phải xin lỗi các cổ động viên Barcelona sau khi lựa chọn rời bỏ đội bóng để gia nhập \"gã nhà giàu\" Ligue 1, Paris Saint-Germain. \r\n\r\nĐiều kiện thứ hai, Neymar phải chấp nhận ký một bản hợp đồng với những điều khoản về thu nhập không còn hấp dẫn như lúc anh khoác áo PSG.\r\n\r\nĐây chắc chắn sẽ là hai thách thức không hề dễ dàng cho Neymar nếu như anh muốn trở về Barcelona.', 'CN Phap TBN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(16, 'dung29', , 'Chelsea, Liverpool chú ý! Sao 70 triệu bảng xác nhận thời điểm chuyển nhượng', 'Ngôi sao đang chơi cho Dortmund, Christian Pulisic đã tiết lộ về thời điểm anh sẽ đàm phán tương lai với CLB,', 'Tuyển thủ quốc gia Mỹ đã được liên kết với Chelsea và Liverpool trong những tuần gần đây sau khi những thông tin từ Đức tuyên bố Pulisic muốn rời Dortmund. Mùa này, anh đã không ra sân quá nhiều vì sự xuất hiện ấn tượng của sao trẻ Jadon Sancho.\r\n\r\nGiao kèo hiện tại giữa hai bên vẫn còn đến năm 2020 và cho đến nay, Pulisic dường như không muốn gia hạn với CLB chủ quản. Bây giờ, tiền đạo sinh năm 1998 khẳng định rằng mình chưa có ý định nói về vấn đề hợp đồng quá sớm.\r\n\r\n\"Tôi vẫn tập trung vào kế hoạch tại Dortmund. Chúng tôi đang làm rất tốt trong mùa giải này\", Pulisic nói với NBC Sports. \"Tôi sẽ nói chuyện với CLB và xem xét tương lai của mình vào tháng Giêng\".\r\n\r\nChelsea, Liverpool chú ý! Sao 70 triệu bảng xác nhận thời điểm chuyển nhượng - Bóng Đá\r\n Ngôi sao lớn nhất của tuyển Mỹ đã tuyên bố về thời điểm mình xác định tương lai tại Dortmund.\r\nJurgen Klopp rất yêu thích Pulisic và nhiều thông tin cho rằng ông muốn chia tay với Fabinho để có ngân sách chiêu mộ cầu thủ ở CLB cũ của mình. Dù vậy, ngôi sao người Brazil mới đến trong mùa hè vừa qua, vì vậy một động thái vào tháng Một là điều khó xảy ra.\r\n\r\nChelsea cũng lên kế hoạch \'cướp hàng\' của Liverpool với số tiền lên tới 70 triệu bảng. Động thái này xảy ra là vì họ lo sợ bị UEFA cấm chuyển nhượng trong vòng hai năm tới. Và Pulisic sẽ mang đến chất lượng lâu dài cho The Blues.', 'CN Anh Duc', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(17, 'hoduc17', , 'Son Heung-min ghi bàn đưa Tottenham trở lại vị trí thứ 2', 'Ngôi sao người Hàn Quốc đóng góp 1 pha lập công trong chiến thắng 3-0 của Tottenham trước chủ nhà Cardiff ở vòng 21 Premier League diễn ra sáng 2/1', '<p>Sau thất bại g&acirc;y sốc 1-3 tr&ecirc;n s&acirc;n nh&agrave; trước t&acirc;n binh Fulham ở v&ograve;ng 20,&nbsp;<a href=\"http://www.bongda.com.vn/Tottenham-search/\" target=\"_blank\">Tottenham</a>&nbsp;h&agrave;nh qu&acirc;n đến s&acirc;n của một CLB mới l&ecirc;n hạng kh&aacute;c l&agrave; Cardiff với mục ti&ecirc;u gi&agrave;nh trọn 3 điểm để đ&ograve;i lại vị tr&iacute; thứ 2 từ tay Man City.</p>\r\n\r\n<p>Đo&agrave;n qu&acirc;n của HLV Mauricio Pochettino mất 3 ph&uacute;t để c&oacute; b&agrave;n thắng đầu ti&ecirc;n v&agrave;o lưới Cardiff. Đường tạt b&oacute;ng của Kieran Trippier khiến hậu vệ chủ nh&agrave; l&uacute;ng t&uacute;ng, Harry Kane chớp thời cơ dứt điểm ở cự ly gần hạ gục thủ m&ocirc;n Neil Etheridge. T&iacute;nh cả&nbsp;b&agrave;n thắng v&agrave;o lưới Cardiff, Harry Kane đ&atilde; chọc thủng lưới to&agrave;n bộ 28 đối thủ anh từng gặp tại Premier League.</p>\r\n\r\n<p><img alt=\"Son Heung-min ghi bàn đưa Tottenham trở lại vị trí thứ 2 - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/02/so-01-0843.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;Harry Kane ho&agrave;n th&agrave;nh bộ sưu tập b&agrave;n thắng v&agrave;o lưới tất cả c&aacute;c CLB anh từng đối đầu.</h2>\r\n\r\n<p>Chỉ 9 ph&uacute;t sau, tỷ số đ&atilde; được n&acirc;ng l&ecirc;n 2-0 cho đội kh&aacute;ch. Tiếp tục l&agrave; một sai lầm của h&agrave;ng thủ đội chủ nh&agrave; tạo cơ hội cho Christian Eriksen thoải m&aacute;i cầm b&oacute;ng, căn chỉnh trước khi tung c&uacute; s&uacute;t hiểm h&oacute;c khiến thủ th&agrave;nh Etheridge chỉ c&ograve;n biết ch&ocirc;n ch&acirc;n.</p>\r\n\r\n<p>Tiếp đ&agrave; hưng phấn, Spurs đẩy cao đội h&igrave;nh tấn c&ocirc;ng v&agrave; c&oacute; b&agrave;n thắng thứ ba v&agrave;o lưới Cardiff ở ph&uacute;t 26. Người lập c&ocirc;ng lần n&agrave;y l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Son+Heung-min-search/\" target=\"_blank\">Son Heung-min</a>. Tiền đạo người H&agrave;n Quốc khống chế kh&eacute;o l&eacute;o đường chuyền của Harry Kane trước khi tung c&uacute; dứt điểm ở tư thế kh&oacute; buộc Etheridge phải v&agrave;o lưới nhặt b&oacute;ng.&nbsp;</p>\r\n\r\n<p><img alt=\"Son Heung-min ghi bàn đưa Tottenham trở lại vị trí thứ 2 - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/02/so-02-0844.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;Son Heung-min duy tr&igrave; phong độ l&agrave;m b&agrave;n ấn tượng c&ugrave;ng Spurs.</h2>\r\n\r\n<p><strong>Ch&acirc;n s&uacute;t người H&agrave;n Quốc đang c&oacute; phong độ thăng hoa tại Premier League khi trực tiếp tham gia v&agrave;o 11 b&agrave;n thắng trong 8 lần đ&aacute; ch&iacute;nh gần nhất</strong>&nbsp;(8 b&agrave;n, 3 kiến tạo).</p>\r\n\r\n<p>3 b&agrave;n thua sớm đ&atilde; đ&aacute;nh sập &yacute; ch&iacute; chiến đấu của c&aacute;c cầu thủ Cardiff. Tottenham c&oacute; thể thi đấu ung dung trong thời gian c&ograve;n lại của trận đấu m&agrave; kh&ocirc;ng phải lo lắng về việc đối thủ sẽ lại lộn ngược d&ograve;ng như v&ograve;ng đấu trước. Cơ hội thỉnh thoảng xuất hiện, nhưng Harry Kane c&ugrave;ng đồng đội kh&ocirc;ng thể tận dụng để ghi th&ecirc;m b&agrave;n thắng.</p>\r\n\r\n<p>Tiếng c&ograve;i của trọng t&agrave;i ch&iacute;nh Kevin Friend vang l&ecirc;n với&nbsp;<a href=\"http://www.bongda.com.vn/tottenham-dai-thang-trong-ngay-premier-league-chinh-thuc-chao-thua-harry-kane-d479508.html\" target=\"_blank\">thắng lợi 3-0 d&agrave;nh cho đội kh&aacute;ch</a>. Tottenham đ&ograve;i lại vị tr&iacute; thứ 2 từ tay Man City với 1 điểm nhiều hơn nhưng vẫn k&eacute;m 6 điểm so với đội đầu bảng Liverpool.</p>\r\n', 'Anh', 1),
(18, 'hoduc17', , 'ưerkjwgrbjfndsjksffffffffffffffffffffffffffffffffffffffffffffffffffff', 'gdfggdfgdfgfdgdfgfdsfdsfdsfsffđfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfđfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdffdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfdfđfdf', '<p>fdsfsfsdfaffsf</p>\r\n', 'AnhPhap', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(19, 'hoduc17', , '5 điểm nhấn Man City 2-1 Liverpool: Salah bị \"bỏ túi\"; The Kop vỡ mộng cúp vàng', 'Chuỗi trận bất bại của Liverpool đã bị cắt đứt, qua đó họ không thể lập lại kỳ tích của Arsenal ở mùa 2003/2004 khi vô địch mà không để thua trận nào.', '<p><strong>1. Sergio Aguero &ndash; &ldquo;hung thần của Liverpool&rdquo;</strong></p>\r\n\r\n<p>Ph&uacute;t 40, nhận b&oacute;ng trong v&ograve;ng cấm ở g&oacute;c kh&aacute; hẹp, Sergio Aguero sau một nhịp khống chế đ&atilde; tung ra c&uacute; đ&aacute; tr&aacute;i ph&aacute; bằng ch&acirc;n tr&aacute;i l&agrave;m tung n&oacute;c lưới của thủ th&agrave;nh Alisson, mở tỷ số trận đấu.</p>\r\n\r\n<p><img alt=\"sau trận - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/9-0609.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Aguero l&agrave; hung thần của Liverpooll.</h2>\r\n\r\n<p>Với b&agrave;n thắng n&agrave;y, &quot;Kun&quot; Aguero đ&atilde; c&oacute; đến 7 b&agrave;n thắng trong 7 lần gần nhất chạm tr&aacute;n Liverpool, tất cả đều thực hiện tr&ecirc;n s&acirc;n Etihad. R&otilde; r&agrave;ng ch&acirc;n s&uacute;t người Argentina l&agrave; nỗi &aacute;m ảnh đối với h&agrave;ng ph&ograve;ng ngự The Kop.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>2. Thảm họa Dejan Lovren</strong></p>\r\n\r\n<p>Cuối c&ugrave;ng điều m&agrave; c&aacute;c CĐV Liverpool lo lắng nhất đ&atilde; xảy ra, mắt x&iacute;ch yếu nhất trong đội h&igrave;nh của The Kop &ndash; Dejan Lovren đ&atilde; bị đối thủ khai th&aacute;c triệt để v&agrave; trở th&agrave;nh thảm họa trong trận đấu n&agrave;y.</p>\r\n\r\n<p><img alt=\"sau trận - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/10-0609.jpg\" width=\"962\" /></p>\r\n\r\n<h2>Lovren mắc sai lầm ở b&agrave;n thua đầu ti&ecirc;n.&nbsp;</h2>\r\n\r\n<p>Ở b&agrave;n thua đầu ti&ecirc;n Lovren để Leroy Sane vượt mặt, sau đ&oacute; anh cũng để Aguero tự do nhận b&oacute;ng v&agrave; dứt điểm trong v&ograve;ng cấm. Ở b&agrave;n thua thứ hai trung vệ người Croatia chọn sai vị tr&iacute; khi h&agrave;ng ph&ograve;ng ngự đ&atilde; d&acirc;ng l&ecirc;n đặt bẫy việt vị. Chưa kể những lần cầu thủ 29 tuổi n&agrave;y chuyền sai, để mất b&oacute;ng trong v&ograve;ng cấm&hellip;</p>\r\n\r\n<p><img alt=\"sau trận - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2019/01/04/13-0609.jpg\" width=\"1366\" /></p>\r\n\r\n<h2>B&agrave;n thua thứ 2 của Liverpool cũng xuất ph&aacute;t từ sai lầm của Lovren.&nbsp;</h2>\r\n\r\n<p><strong>3. Qu&aacute; đen cho The Kop</strong></p>\r\n\r\n<p>Ph&uacute;t 18, c&uacute; ph&aacute; b&oacute;ng của John Stones sau c&uacute; dứt điểm dội cột dọc của Mane đ&atilde; đập tr&uacute;ng Ederson dội ngược về ph&iacute;a khung th&agrave;nh trống của Man City, thế nhưng rất may một lần nữa Stones kịp l&ugrave;i về ph&aacute; b&oacute;ng trước khi b&oacute;ng đi qua vạch v&ocirc;i.</p>\r\n', 'AnhTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(20, 'hoduc17', , 'Sao Liverpool: \"Chúng tôi thua Man City vì thiếu may mắn\"', 'Georginio Wijnaldum cho rằng Liverpool thua Man City vì thiếu may mắn. ', '<p>L&agrave;m kh&aacute;ch tr&ecirc;n s&acirc;n Etihad của Man City,&nbsp;<a href=\"http://www.bongda.com.vn/Liverpool-search/\" target=\"_blank\">Liverpool</a>&nbsp;đ&atilde; trải qua 90 ph&uacute;t kh&ocirc;ng hề dễ d&agrave;ng trước đối thủ. D&ugrave; tạo ra kh&ocirc;ng &iacute;t cơ hội nguy hiểm v&agrave; thậm ch&iacute; đ&atilde; tiến s&aacute;t đến việc lội ngược d&ograve;ng, tuy nhi&ecirc;n, cuối c&ugrave;ng The Kop vẫn phải chấp nhận thất bại 1-2 trước những nh&agrave; đương kim v&ocirc; địch Premier League.&nbsp;</p>\r\n\r\n<p>Kết quả n&agrave;y đ&atilde; khiến đo&agrave;n qu&acirc;n của HLV Jurgen Klopp để đối thủ r&uacute;t ngắn khoảng c&aacute;ch xuống chỉ c&ograve;n 4 điểm tr&ecirc;n bảng xếp hạng.</p>\r\n\r\n<p>D&ugrave; vậy, ph&aacute;t biểu sau trận đấu, tiền vệ của Liverpool,&nbsp;<a href=\"http://www.bongda.com.vn/Georginio+Wijnaldum-search/\" target=\"_blank\">Georginio Wijnaldum</a>&nbsp;vẫn tỏ ra b&igrave;nh thản: &quot;<em>T&ocirc;i nghĩ ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; thể gi&agrave;nh được 1 điểm v&agrave; thậm ch&iacute; l&agrave; một chiến thắng trước Man City.&nbsp;</em></p>\r\n\r\n<p><img alt=\"Sao Liverpool: \" src=\"http://media.bongda.com.vn/files/trong.le/2019/01/04/liverpool-1143.jpg\" width=\"810\" /></p>\r\n\r\n<p><em>Tuy nhi&ecirc;n,&nbsp;<strong>Liverpool đ&atilde; thua v&igrave; thiếu may mắn</strong>&nbsp;v&agrave; cũng bởi v&igrave; ch&uacute;ng t&ocirc;i kh&ocirc;ng thể tận dụng được những cơ hội m&igrave;nh c&oacute;. Thế nhưng thời điểm n&agrave;y, ch&uacute;ng t&ocirc;i cần phải nhanh ch&oacute;ng lấy lại sự tự tin v&agrave; hướng đến chiến thắng trong trận đấu kế tiếp.&nbsp;</em></p>\r\n\r\n<p><em>Ch&uacute;ng t&ocirc;i đ&atilde; li&ecirc;n tiếp tấn c&ocirc;ng Man City v&agrave; họ cũng vậy. Ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; thể h&ograve;a hoặc thắng đối thủ. Ở m&ugrave;a giải n&agrave;y, trong một số trận đấu, ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; may mắn đồng h&agrave;nh để gi&agrave;nh trọn vẹn 3 điểm nhưng đ&ecirc;m nay, điều đ&oacute; đ&atilde; kh&ocirc;ng c&ograve;n xuất hiện c&ugrave;ng Liverpool</em>&quot;.&nbsp;</p>\r\n', 'AnhC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(21, 'hoduc17', , 'HLV tuyển Iran cầu cứu liên đoàn bóng đá trước thềm Asian Cup 2019', 'Sau hàng loạt rắc rối hậu trường, HLV Carlos Queiroz lên tiếng cầu cứu Liên đoàn Bóng đá Iran (IFA), yêu cầu họ bảo vệ đội tuyển trước sức ép từ giới truyền thông và người hâm mộ.', '<p>Đội tuyển Iran đang đứng giữa mu&ocirc;n tr&ugrave;ng kh&oacute; khăn trong kh&acirc;u chuẩn bị cho&nbsp;Asian Cup 2019. Sau h&agrave;ng loạt chấn thương của c&aacute;c trụ cột l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/hlv-queiroz-chia-tay-tuyen-iran-sau-asian-cup-2019-d479071.html\" target=\"_blank\">những l&ugrave;m x&ugrave;m li&ecirc;n quan tới tương lai của HLV Carlos Queiroz</a>&nbsp;v&agrave; c&acirc;u hỏi về tham vọng thực sự của đội tuyển tại giải đấu tới đ&acirc;y.</p>\r\n\r\n<p>Do đ&oacute;, chiến lược gia người Bồ Đ&agrave;o Nha đ&atilde; phải l&ecirc;n tiếng cầu cứu IFA nhằm đảm bảo đội tuyển c&oacute; sự tập trung tối đa cho kh&acirc;u chuẩn bị khi m&agrave; giải đấu đ&atilde; cận kề.&nbsp;</p>\r\n\r\n<p><img alt=\"HLV tuyển Iran cầu cứu liên đoàn bóng đá trước thềm Asian Cup 2019 - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/04/ir-02-1144.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;HLV Queiroz phải l&ecirc;n tiếng cầu cứu IFA.&nbsp;</h2>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i muốn chuẩn bị cho giải đấu với sự tập trung cao độ v&agrave;&nbsp;<strong>mong Chủ tịch IFA&nbsp;Mehdi Taj bảo vệ ch&uacute;ng t&ocirc;i khỏi những c&aacute; nh&acirc;n g&acirc;y phiền phức, thường xuy&ecirc;n đặt nghi vấn về tham vọng thực sự của đội nh&agrave;</strong>. Đ&acirc;y kh&ocirc;ng phải thời điểm th&iacute;ch hợp cho những rắc rối, v&agrave; ch&uacute;ng t&ocirc;i cần phải được bảo vệ trước những con c&aacute; sấu&quot;</em>, chiến lược gia người Bồ Đ&agrave;o Nha nhấn mạnh.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i đang tập trung cho trận mở m&agrave;n gặp đội tuyển Yemen. Ở những giải đấu như n&agrave;y, trận đấu đầu ti&ecirc;n lu&ocirc;n v&ocirc; c&ugrave;ng kh&oacute; khăn. Ch&uacute;ng t&ocirc;i cần một chiến thắng. Kh&ocirc;ng cần n&oacute;i cũng biết, Iran đ&atilde; kh&ocirc;ng v&ocirc; địch giải đấu từ hơn 40 năm nay rồi. C&aacute;c đội b&oacute;ng tại Iran cũng đang c&oacute; vấn đề của ri&ecirc;ng họ&quot;</em>, &ocirc;ng cho biết th&ecirc;m.&nbsp;</p>\r\n\r\n<p>Tại giải đấu lần n&agrave;y, HLV&nbsp;<a href=\"http://www.bongda.com.vn/Carlos+Queiroz-search/\" target=\"_blank\">Queiroz</a>&nbsp;mang sang UAE 18 cầu thủ từng c&ugrave;ng &ocirc;ng chinh chiến tại&nbsp;World Cup 2018&nbsp;tr&ecirc;n đất Nga. D&ugrave; c&oacute; đội h&igrave;nh rất mạnh nhưng chiến lược gia 65 tuổi chỉ đặt mục ti&ecirc;u khi&ecirc;m tốn l&agrave; lọt tới b&aacute;n kết.</p>\r\n\r\n<p>Bởi vậy, rất nhiều CĐV tỏ ra ho&agrave;i nghi về tham vọng cũng như t&acirc;m huyết của &ocirc;ng d&agrave;nh cho đội tuyển Iran.&nbsp;</p>\r\n\r\n<p><img alt=\"HLV tuyển Iran cầu cứu liên đoàn bóng đá trước thềm Asian Cup 2019 - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nhat.nguyen/2019/01/04/ir-03-1145.jpg\" width=\"600\" /></p>\r\n\r\n<h2>&nbsp;HLV Queiroz kh&ocirc;ng nhận được sự ủng hộ đ&uacute;ng mực từ CĐV nh&agrave;.&nbsp;</h2>\r\n\r\n<p><em>&quot;Khi t&ocirc;i nhậm chức 7 năm trước, b&oacute;ng đ&aacute;&nbsp;<a href=\"http://www.bongda.com.vn/Iran-search/\" target=\"_blank\">Iran</a>&nbsp;thậm ch&iacute; c&ograve;n run sợ trước cả Bahrain. V&agrave; giờ, t&ocirc;i phải nhấn mạnh lại một lần nữa: H&agrave;n Quốc, Nhật Bản, Australia l&agrave; ba ứng vi&ecirc;n h&agrave;ng đầu cho chức v&ocirc; địch. V&agrave; ch&uacute;ng t&ocirc;i sẽ chiến đấu hết sức cho một suất cuối c&ugrave;ng tại v&ograve;ng b&aacute;n kết&quot;</em>, HLV người Bồ Đ&agrave;o Nha giải th&iacute;ch.</p>\r\n\r\n<p>Tại Asian Cup 2019, đo&agrave;n qu&acirc;n của HLV Queiroz nằm ở bảng D c&ugrave;ng c&aacute;c đối thủ Iraq, Yemen v&agrave; tuyển Việt Nam.&nbsp;</p>\r\n\r\n<p>V&agrave;o ng&agrave;y 7/1 tới đ&acirc;y, đội tuyển Iran sẽ bắt đầu chiến dịch Asian Cup với cuộc chạm tr&aacute;n Yemen. Sau đ&oacute;,&nbsp;Team Melli&nbsp;sẽ lần lượt đối đầu tuyển Việt Nam (12/1) v&agrave; Iraq (16/1).</p>\r\n', 'AnhTBNCN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(22, 'hoduc17', , 'Không phải AC Milan, Chelsea sẽ bán Morata cho ƯCV vô địch La Liga', 'Chelsea đã bất ngờ thay đổi quan điểm trong việc chuyển nhượng tiền đạo Alvaro Morata.', '<p>Trong khoảng thời gian qua, truyền th&ocirc;ng Anh kh&ocirc;ng ngừng đưa tin về việc Chelsea v&agrave; AC Milan sẽ thực hiện một thương vụ trao đổi tiền đạo khi The Blues sẽ lấy về Gonzalo Higuain trong khi&nbsp;<a href=\"http://www.bongda.com.vn/Alvaro+Morata-search/\" target=\"_blank\">Alvaro Morata</a>&nbsp;sẽ ra đi theo chiều ngược lại.&nbsp;</p>\r\n\r\n<p>Gia nhập s&acirc;n Stamford Bridge v&agrave;o m&ugrave;a h&egrave; năm 2017 với mức gi&aacute; l&ecirc;n đến 60 triệu bảng, tuy nhi&ecirc;n, cựu cầu thủ Real Madrid đ&atilde; kh&ocirc;ng thể khẳng định được bản th&acirc;n ở London. Anh chỉ c&oacute; được 15 pha lập c&ocirc;ng sau 48 trận m&ugrave;a trước v&agrave; 7 b&agrave;n sau 23 trận m&ugrave;a n&agrave;y.&nbsp;</p>\r\n\r\n<p>Với phong độ k&eacute;m ấn tượng c&ugrave;ng kỹ năng dứt điểm đang bị đặt dấu hỏi, Morata được đồn đo&aacute;n rằng đ&atilde; kh&ocirc;ng c&ograve;n tương lai ở&nbsp;<a href=\"http://www.bongda.com.vn/Chelsea-search/\" target=\"_blank\">Chelsea</a>&nbsp;v&agrave; sẽ phải sớm đầu qu&acirc;n cho một đội b&oacute;ng kh&aacute;c trong tương lai.&nbsp;</p>\r\n\r\n<p><img alt=\"Không phải AC Milan, Chelsea sẽ bán Morata cho ƯCV vô địch La Liga - Bóng Đá\" src=\"http://media.bongda.com.vn/files/trong.le/2019/01/04/morata-1-1032.jpg\" width=\"800\" /></p>\r\n\r\n<h2>Tương lai của Morata ở Chelsea đang rất bấp b&ecirc;nh.&nbsp;&nbsp;</h2>\r\n\r\n<p>Tuy nhi&ecirc;n, theo th&ocirc;ng tin từ tờ Daily Mirror, ch&acirc;n s&uacute;t người T&acirc;y Ban Nha nhiều khả năng sẽ kh&ocirc;ng chuyển đến AC Milan m&agrave; thay v&agrave;o đ&oacute;,<strong>&nbsp;Sevilla mới l&agrave; điểm đến của tiền đạo 26 tuổi</strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Đội b&oacute;ng của HLV Pablo Machin đang cạnh tranh ng&ocirc;i đầu La Liga với Barcelona v&agrave; Atletico Madrid khi đ&atilde; c&oacute; được 32 điểm sau 17 v&ograve;ng đấu, k&eacute;m hai c&acirc;u lạc bộ tr&ecirc;n lần lượt&nbsp;5 v&agrave;&nbsp;2 điểm. Do đ&oacute;, họ đang rất cần bổ sung lực lượng để tăng cường sức mạnh trong giai đoạn lượt về.&nbsp;</p>\r\n\r\n<p>Phi Yến | 09:14 04/01/2019</p>\r\n\r\n<p>TỪ KH&Oacute;A</p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/chelsea-tag30/\">Chelsea</a>&nbsp;<a href=\"http://www.bongda.com.vn/ac-milan-tag13/\">AC Milan</a>&nbsp;<a href=\"http://www.bongda.com.vn/alvaro-morata-tag144/\">alvaro morata</a>&nbsp;<a href=\"http://www.bongda.com.vn/sevilla-tag1020/\">Sevilla</a></p>\r\n\r\n<p>TIN MỚI C&Ugrave;NG CHUY&Ecirc;N MỤC</p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/bi-gerrard-moi-cuop-cho-sao-liverpool-tinh-duong-roi-anfield-d479793.html\">Bị &quot;Gerrard mới&quot; cướp chỗ, sao Liverpool t&iacute;nh đường rời Anfield</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/soc-mua-quang-hai-50-trieu-do-va-khien-anh-phuc-vu-dtqg-trung-quoc-d479781.html\">Sốc! &quot;Mua Quang Hải 50 triệu đ&ocirc; v&agrave; khiến anh phục vụ ĐTQG Trung Quốc&quot;</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/dung-la-da-co-de-nghi-tu-man-utd-that-kho-de-toi-khong-nghi-ve-ho-d479772.html\">&quot;Đ&uacute;ng l&agrave; đ&atilde; c&oacute; đề nghị từ Man Utd. Thật kh&oacute; để t&ocirc;i kh&ocirc;ng nghĩ về họ&quot;</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/xong-ramsey-ky-thoa-thuan-gia-nhap-ben-do-moi-luong-65-trieu-euro-mua-d479773.html\">Xong! Ramsey k&yacute; thỏa thuận gia nhập bến đỗ mới, lương 6.5 triệu euro/m&ugrave;a</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/khong-chi-ramsey-juventus-con-tinh-chieu-mo-ca-sao-man-united-d479766.html\">Kh&ocirc;ng chỉ Ramsey, Juventus c&ograve;n t&iacute;nh chi&ecirc;u mộ cả sao Man United</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/man-utd-co-dong-thai-cu-the-vi-tien-dao-40-trieu-euro-nguoi-nhat-ban-d479758.html\">Man Utd c&oacute; động th&aacute;i cụ thể v&igrave; tiền đạo 40 triệu euro người Nhật Bản</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/messi-chi-ra-5-cai-ten-barcelona-nen-mua-d479735.html\">Messi chỉ ra 5 c&aacute;i t&ecirc;n Barcelona n&ecirc;n mua</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/chuyen-nhuong-03-01-mu-chot-2-bom-tan-ra-gia-ban-bailly-2-cai-ten-roi-chelsea-d479712.html\">Chuyển nhượng 03/01: M.U chốt 2 &#39;bom tấn&#39;, ra gi&aacute; b&aacute;n Bailly; 2 c&aacute;i t&ecirc;n rời Chelsea</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/10-ngoi-sao-dang-mua-nhat-o-premier-league-mua-he-2019-d479718.html\">10 ng&ocirc;i sao đ&aacute;ng mua nhất ở Premier League m&ugrave;a H&egrave; 2019</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/rat-nhanh-man-utd-ra-de-nghi-khien-trung-ve-dang-cap-lung-lay-d479716.html\">Rất nhanh! Man Utd ra đề nghị khiến trung vệ đẳng cấp lung lay</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/chua-den-man-utd-pochettino-da-doi-ed-woodward-mua-sao-70-trieu-bang-cua-leicester-d479706.html\">Chưa đến Man Utd, Pochettino đ&atilde; đ&ograve;i Ed Woodward mua sao 70 triệu bảng của Leicester</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/nong-fenerbahce-tien-gan-toi-chu-ky-cua-tro-cung-mourinho-nhung-that-sung-duoi-tay-solskjaer-d479715.html\">N&oacute;ng! Fenerbahce tiến gần tới chữ k&yacute; của &#39;tr&ograve; cưng&#39; Mourinho nhưng &#39;thất sủng&#39; dưới tay Solskjaer</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/sao-chelsea-dat-thoa-thuan-voi-monaco-su-that-soc-lien-quan-den-pogba-mu-va-barca-d479684.html\">Sao Chelsea đạt thỏa thuận với Monaco, sự thật sốc li&ecirc;n quan đến Pogba, MU v&agrave; Barca</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/christian-pulisic-la-mot-thuong-vu-nong-voi-cua-chelsea-d479590.html\">Christian Pulisic l&agrave; một thương vụ... &quot;n&oacute;ng vội&quot; của Chelsea?</a></h3>\r\n	</li>\r\n</ul>\r\n', 'AnhTBNC1CN', 1),
(23, 'hoduc17', , 'Messi muốn Barca chi 162 triệu bảng vì ngôi sao này, Arsenal để mắt trung vệ thành Turin', 'Sau khi Chelsea nổ bom tấn mang tên Christian Pulisic, các đại gia khác ở châu Âu cũng không chịu ngồi yên.', '<p>Tờ Marca mới đ&acirc;y đ&atilde; đưa ra một th&ocirc;ng tin kh&aacute; bất ngờ. Họ tiết lộ si&ecirc;u sao&nbsp;<a href=\"http://www.bongda.com.vn/ket-thuc-nam-2018-messi-van-la-sat-thu-dang-so-nhat-d479455.html\" target=\"_blank\">Lionel Messi</a>&nbsp;rất muốn Neymar trở lại s&acirc;n Nou Camp. Messi cho hay anh ngưỡng mộ t&agrave;i năng của tiền đạo đang trong bi&ecirc;n chế PSG v&agrave; rất muốn t&aacute;i hợp với Neymar d&ugrave; mọi chuyện hơi phức tạp.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi muốn Barca chi 162 triệu bảng vì ngôi sao này, Arsenal để mắt trung vệ thành Turin - Bóng Đá\" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/neymar-vs-cavani-phat-den-2012.jpg\" width=\"630\" /></p>\r\n\r\n<h2>&nbsp;Neymar kh&ocirc;ng hạnh ph&uacute;c ở PSG.&nbsp;</h2>\r\n\r\n<p>Messi chia sẻ:<em>&nbsp;&quot;Neymar trở lại Barca ư? T&ocirc;i thấy điều n&agrave;y hơi phức tạp. Ch&uacute;ng t&ocirc;i y&ecirc;u cậu ấy v&agrave; muốn cậu ấy trở lại, trong cả tư c&aacute;ch cầu thủ lẫn một người bạn trong ph&ograve;ng thay đồ.&nbsp;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><em>Ch&uacute;ng t&ocirc;i l&agrave; bạn, ch&uacute;ng t&ocirc;i chia sẻ những khoảnh khắc ngọt ng&agrave;o v&agrave; cả những l&uacute;c kh&ocirc;ng vui. Nhưng ch&uacute;ng t&ocirc;i d&agrave;nh cho nhau kh&aacute; nhiều thời gian. T&ocirc;i thấy hơi kh&oacute; để anh ấy rời Paris. PSG kh&ocirc;ng muốn Neymar ra đi,&quot;&nbsp;</em>Messi nhận định.&nbsp;</p>\r\n\r\n<p><strong>Chiều theo &yacute; của Messi, BLĐ Barca đ&atilde; đưa PSG lời đề nghị 162 triệu bảng để mua lại Neymar.</strong>&nbsp;Thực tế, từ khi chuyển đến Paris, Neymar lu&ocirc;n gặp những rắc rối tr&ecirc;n s&acirc;n cỏ lẫn ngo&agrave;i s&acirc;n đấu. Anh được cho l&agrave; kh&ocirc;ng được l&ograve;ng c&aacute;c đồng đội, trong khi đ&oacute; PSG kh&ocirc;ng thể đi s&acirc;u ở&nbsp;<a href=\"http://www.bongda.com.vn/champions-league/\" target=\"_blank\">Champions League</a>.&nbsp;Hiện tại, Neymar đ&atilde; trở về qu&ecirc; nh&agrave; để nghỉ Đ&ocirc;ng v&agrave; chữa trị dứt điểm chấn thương.&nbsp;</p>\r\n\r\n<p>Trong khi đ&oacute;&nbsp;<a href=\"http://www.bongda.com.vn/pulisic-va-nhung-ban-hop-dong-dat-gia-nhat-lich-su-chelsea-d479606.html\" target=\"_blank\">sau Chelsea</a>, Arsenal l&agrave; đội b&oacute;ng gần nhất c&oacute; thể nổ bom tấn. H&agrave;ng thủ vừa thiếu vừa yếu của Arsenal đang khiến đ&aacute;nh rơi kh&aacute; nhiều điểm số trong những v&ograve;ng đấu gần đ&acirc;y.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi muốn Barca chi 162 triệu bảng vì ngôi sao này, Arsenal để mắt trung vệ thành Turin - Bóng Đá\" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/3-2021.jpg\" width=\"630\" /></p>\r\n\r\n<h2>&nbsp;H&agrave;ng thủ Arsena cần được n&acirc;ng cấp.&nbsp;</h2>\r\n\r\n<p>Ngay lập tức BLĐ Arsenal đ&atilde; c&oacute; những phương &aacute;n để gia cố tuyến dưới, đặc biệt l&agrave; vị tr&iacute; trung vệ. Theo đ&oacute;, Ph&aacute;o thủ đ&atilde; c&oacute; những li&ecirc;n hệ với&nbsp;Nicolas N&rsquo;Koulou của Torino. Anh l&agrave; đội trưởng của Cameroon v&agrave; chỉ c&oacute; gi&aacute; khoảng 3,5 triệu bảng tr&ecirc;n TTCN.</p>\r\n\r\n<p>Thực tế, thực lực của Arsenal kh&oacute; l&ograve;ng tranh chấp những mục ti&ecirc;u lớn với những &ocirc;ng lớn c&ograve;n lại của Premier League.&nbsp;Họ cũng kh&ocirc;ng thể mạo hiểm bởi mua b&aacute;n ở th&aacute;ng Gi&ecirc;ng thường ẩn chứa nhiều rủi ro.&nbsp;</p>\r\n\r\n<p><img alt=\"Messi muốn Barca chi 162 triệu bảng vì ngôi sao này, Arsenal để mắt trung vệ thành Turin - Bóng Đá\" src=\"http://media.bongda.com.vn/files/phi.do/2019/01/03/nkoulou-2044.jpg\" width=\"696\" /></p>\r\n\r\n<h2>&nbsp;N&rsquo;Koulou l&agrave; sự lựa chọn hợp l&iacute; của Arsenal v&agrave;o th&aacute;ng Gi&ecirc;ng.&nbsp;</h2>\r\n\r\n<p>Nkoulou được đ&aacute;nh gi&aacute; l&agrave; một cầu thủ đủ tốt để v&aacute; v&iacute;u h&agrave;ng thủ gặp qu&aacute; nhiều vấn đề của đội chủ s&acirc;n Emirates. Anh được đ&aacute;nh gi&aacute; cao bởi khả năng tranh chấp v&agrave; sự tập trung.&nbsp;</p>\r\n\r\n<p>M&ugrave;a n&agrave;y, anh l&agrave; trụ cột của Torino, ra s&acirc;n đủ 19 trận v&agrave; ghi được 2 b&agrave;n thắng. Đ&aacute;ng ch&uacute; &yacute;, khả năng d&ugrave;ng ch&acirc;n của&nbsp;Nkoulou kh&aacute; ấn tượng với việc thực hiện th&agrave;nh c&ocirc;ng 92% số đường chuyền.&nbsp;</p>\r\n\r\n<p><strong>Những pha b&oacute;ng hay của Neymar:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Ngọa Long | 21:09 02/01/2019</p>\r\n', 'AnhPhapC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(24, 'hoduc17', , 'Xong! Ramsey ký thỏa thuận gia nhập bến đỗ mới, lương 6.5 triệu euro/mùa', 'Điểm đến của ngôi sao Arsenal được nhiều đội bóng lớn thèm khát đã sáng tỏ.', '<p>Tương lai của Aaron Ramsey l&agrave; chủ đề đ&atilde; được b&agrave;n t&aacute;n suốt nhiều th&aacute;ng qua. Hợp đồng hiện tại của tuyển thủ Xứ Wales tại Emirates sẽ đ&aacute;o hạn khi m&ugrave;a giải 2018/19 kh&eacute;p lại v&agrave; qu&aacute; tr&igrave;nh thương thảo gia hạn với&nbsp;<a href=\"http://www.bongda.com.vn/arsenal-search/\" target=\"_blank\">Arsenal</a>&nbsp;đ&atilde; đổ vỡ, đồng nghĩa anh sẽ ra đi sau hơn 10 năm gắn b&oacute;.</p>\r\n\r\n<p>D&ugrave; kh&ocirc;ng được BLĐ Ph&aacute;o Thủ quyết t&acirc;m giữ ch&acirc;n nhưng&nbsp;<a href=\"http://www.bongda.com.vn/10-ngoi-sao-dang-mua-nhat-o-premier-league-mua-he-2019-d479718.html\" target=\"_blank\">khả năng của Ramsey l&agrave; điều kh&ocirc;ng b&agrave;n c&atilde;i</a>. Ng&ocirc;i sao 28 tuổi l&agrave; một trong những tiền vệ h&agrave;ng đầu Ch&acirc;u &Acirc;u những năm qua v&agrave; được nhiều đại gia kh&aacute;c trải thảm săn đ&oacute;n, bao gồm c&aacute;c đối thủ của Arsenal tại Premier League như Manchester United hay Liverpool.</p>\r\n\r\n<p><img alt=\"Juve ký Ramsey - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2019/01/04/maxresdefault-0758.jpg\" width=\"1280\" /></p>\r\n\r\n<h2>&nbsp;Ramsey đ&atilde; chọn Juventus.</h2>\r\n\r\n<p>Tuy nhi&ecirc;n theo th&ocirc;ng tin mới nhất, Ramsey đ&atilde; quyết định chuyển sang &Yacute; thi đấu.&nbsp;Sportmediaset cho hay&nbsp;<strong>Số 8 Ph&aacute;o Thủ đ&atilde; k&yacute; xong thỏa thuận&nbsp;ghi nhớ&nbsp;với Juve</strong>&nbsp;v&agrave; thậm ch&iacute; c&oacute; thể kho&aacute;c &aacute;o Bianconeri ngay trong th&aacute;ng n&agrave;y. Mức đ&atilde;i ngộ Ramsey được hưởng tại Allianz sẽ l&agrave; 6.5 triệu euro/m&ugrave;a k&egrave;m điều khoản cộng th&ecirc;m.</p>\r\n\r\n<p>Thứ tư vừa qua, Gi&aacute;m đốc Juve, Fabio Paratici từng c&ocirc;ng khai thừa nhận Bianconeri đang xem x&eacute;t c&aacute;c khả năng thực hiện thương vụ&nbsp;<a href=\"http://www.bongda.com.vn/aaron+ramsey-search/\" target=\"_blank\">Ramsey</a>.</p>\r\n\r\n<p>Phụng Sồ | 07:25 04/01/2019</p>\r\n', 'AnhPhapTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(25, 'ducdeptrai', , 'Rời Man Utd, Jose Mourinho sẽ về đâu?', 'Tương lai của Jose Mourinho chưa có gì rõ ràng sau khi bị Manchester United sa thải.', '<p>Tương lai của Jose Mourinho chưa c&oacute; g&igrave; r&otilde; r&agrave;ng sau khi bị Manchester United sa thải.</p>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s1-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;HLV Jose Mourinho đ&atilde; bị Man United sa thải c&aacute;ch đ&acirc;y kh&ocirc;ng l&acirc;u sau thất bại nặng nề 1-3 trước Liverpool.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s2-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Hiện tại, chiến lược gia người Bồ Đ&agrave;o Nha vẫn đang thất nghiệp.</h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/10-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;D&ugrave; vậy, với t&agrave;i năng v&agrave; số danh hiệu đồ sộ đ&atilde; đoạt được trong qu&aacute; khứ, Mourinho vẫn l&agrave; c&aacute;i t&ecirc;n hot đối với nhiều đội b&oacute;ng lớn.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/7-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Real Madrid được cho l&agrave; điểm đến khả dĩ nhất của &#39;Người đặc biệt&#39;.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s8-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Từng c&oacute; thời gian l&agrave;m việc ở đ&acirc;y, Mourinho kh&ocirc;ng qu&aacute; xa lạ với bầu kh&ocirc;ng kh&iacute; s&acirc;n Bernabeu.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s9-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Nếu kh&ocirc;ng c&oacute; g&igrave; bất ngờ, Mourinho sẽ l&ecirc;n thay thế Solari ngay khi m&ugrave;a giải n&agrave;y kết th&uacute;c.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s5-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Inter Milan cũng l&agrave; điểm đến tiềm năng kh&aacute;c. Tại Italia, Mourinho từng gi&uacute;p CLB Inter Milan đoạt c&uacute; ăn ba vĩ đại m&ugrave;a giải 2009/10.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s6-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tuy nhi&ecirc;n,&nbsp;trog b&agrave;i phỏng vấn mới đ&acirc;y với Sky Sports Italia, đ&iacute;ch th&acirc;n Gi&aacute;m đốc thể thao Piero Ausilio đ&atilde; l&ecirc;n tiếng khẳng định Inter vẫn tin tưởng ở Spalletti.</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s4-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Cụ thể, Ausilio thừa nhận: &quot;Kế hoạch của CLB vẫn đang tiếp diễn sau 1 năm rưỡi với Spalletti v&agrave; sẽ tiếp tục đi c&ugrave;ng &ocirc;ng ấy nhiều năm nữa.&quot;</h2>\r\n\r\n<p><img alt=\"Jose Mourinho bị đội bóng cũ khước từ - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/31/s3-2000.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;V&agrave;i năm qua, sự nghiệp của Mourinho kh&ocirc;ng c&oacute; qu&aacute; nhiều nổi bật. Phương ph&aacute;p của &ocirc;ng bị cho l&agrave; đ&atilde; hết hiệu quả khi li&ecirc;n tiếp bị sa thải ở những nơi &ocirc;ng đi qua.</h2>\r\n', 'AnhTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(26, 'ducdeptrai', , 'Herrera chỉ ra thay đổi lớn nhất của Pogba từ khi Mourinho bị sa thải', 'Tiền vệ Tây Ban Nha đưa ra nhận xét về biến chuyển của người đồng đội.', '<p>Paul Pogba từng bị đ&agrave;y ải trong giai đoạn cuối triều đại&nbsp;<a href=\"http://www.bongda.com.vn/jose+mourinho-search/\" target=\"_blank\">Jose Mourinho</a>, nhưng việc t&acirc;n HLV Ole Gunnar Solskjaer tiếp quản đ&atilde; mở ra khởi đầu mới với tuyển thủ Ph&aacute;p.</p>\r\n\r\n<p>Chiến lược gia người Na Uy&nbsp;<a href=\"http://www.bongda.com.vn/toi-chac-chan-chac-chan-dang-nhin-thay-pogba-tot-nhat-minh-tung-biet-d479569.html\" target=\"_blank\">trao cho Pogba sự tự do nhiều hơn</a>. Đ&aacute;p lại, tiền vệ 25 tuổi tỏa s&aacute;ng rực rỡ khi g&oacute;p c&ocirc;ng 4 b&agrave;n thắng c&ugrave;ng 3 đường kiến tạo trong 4 thắng lợi li&ecirc;n tiếp vừa qua của Manchester United.</p>\r\n\r\n<p><img alt=\"Herrera chỉ ra sự thay đổi của Pogba kể từ khi Mourinho ra đi - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2019/01/04/gettyimages-1075936970-1150.jpg\" width=\"540\" /></p>\r\n\r\n<h2>&nbsp;Pogba b&ugrave;ng nổ ở triều đại mới.</h2>\r\n\r\n<p>Sự giải ph&oacute;ng tinh thần cũng gi&uacute;p Pogba t&iacute;ch cực đ&oacute;ng g&oacute;p cho lối chơi chung hơn, bằng c&aacute;ch tranh chấp t&aacute;i chiếm quyền kiểm so&aacute;t, điều Ander Herrera xem như thay đổi lớn nhất của người đồng đội kể từ sau biến động tr&ecirc;n băng ghế chỉ đạo.</p>\r\n\r\n<p><em>&quot;Paul đang chơi rất, rất tốt.&quot;</em>&nbsp;Metro dẫn lời Herrera.&nbsp;<em>&quot;Kh&ocirc;ng chỉ với b&oacute;ng, t&ocirc;i nghĩ ngay khi ch&uacute;ng t&ocirc;i mất b&oacute;ng,&nbsp;<strong>cậu ấy sẵn s&agrave;ng ph&ograve;ng ngự, sẵn s&agrave;ng gi&uacute;p đỡ tập thể.</strong>&quot;</em></p>\r\n\r\n<p><em>&quot;Paul thi đấu rất đơn giản v&agrave; hiệu quả ở phần s&acirc;n nh&agrave;. Khi bước sang nửa kia s&acirc;n, cậu ấy sở hữu ma thuật để thay đổi cục diện trận đấu. V&igrave; vậy, ch&uacute;ng t&ocirc;i thật sự vui cho&nbsp;<a href=\"http://www.bongda.com.vn/paul+pogba-search/\" target=\"_blank\">Paul</a>.&quot;</em></p>\r\n\r\n<p>Phụng Sồ | 11:10 04/01/2019</p>\r\n', 'AnhC1CN', 1),
(27, 'ducdeptrai', , '\"Cậu ta gặp may khi đạp vào đùi Pogba\"', 'Phân tích trên Sky Sports, cựu trọng tài Anh Dermot Gallagher khẳng định, Jonjo Shelvey đã có tình huống chơi xấu Paul Pogba.', '<p>Tr&ecirc;n s&acirc;n St James&#39; Park ở v&ograve;ng 21 Premier League, Man United&nbsp;đ&atilde; gi&agrave;nh được chiến thắng 2-0 trước Newcastle nhờ c&aacute;c pha lập c&ocirc;ng của&nbsp;Romelu Lukaku v&agrave; Marcus Rashford. Đ&acirc;y l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/thang-4-tran-lien-solskjaer-tro-lai-lowry-vao-khuya-muon-d479708.html\" target=\"_blank\">chiến thắng thứ 4 li&ecirc;n tiếp</a>&nbsp;cho&nbsp;Quỷ đỏ dưới thời&nbsp;Ole Gunnar Solskjaer.</p>\r\n\r\n<p>Tuy vậy, vẫn c&oacute; t&igrave;nh huống tranh c&atilde;i nổ ra khi&nbsp;Jonjo Shelvey c&oacute;&nbsp;pha đạp thẳng v&agrave;o đ&ugrave;i Paul Pogba. Đ&aacute;ng ch&uacute; &yacute;, kh&ocirc;ng c&oacute; tấm thẻ đỏ n&agrave;o được r&uacute;t ra.&nbsp;Ph&acirc;n t&iacute;ch tr&ecirc;n Sky Sports, cựu trọng t&agrave;i Anh Dermot Gallagher cho rằng,&nbsp;Jonjo Shelvey đ&atilde; gặp may.</p>\r\n\r\n<p><img alt=\"\" src=\"http://media.bongda.com.vn/files/hai.phan/2019/01/04/skysports-pogba-shelvey-paul-pogba_4536219-0720.jpg\" width=\"768\" /></p>\r\n\r\n<h2>&nbsp;T&igrave;nh huống xấu chơi của Shelvey với Pogba nhưng kh&ocirc;ng c&oacute; chiếc thẻ đỏ n&agrave;o được r&uacute;t ra.</h2>\r\n\r\n<p>Cụ thể,&nbsp;Dermot Gallagher nhận định:<em>&nbsp;&quot;<strong>Đ&oacute; l&agrave; một chiếc thẻ đỏ kh&ocirc;ng phải b&agrave;n c&atilde;i.</strong>&nbsp;Cậu ta đ&atilde; chơi cao ch&acirc;n với chủ đ&iacute;ch rất r&otilde; r&agrave;ng. Trọng t&agrave;i đứng sau lưng&nbsp;Shelvey n&ecirc;n rất c&oacute; khả năng &ocirc;ng ấy đ&atilde; bị che khuất tầm mắt.&nbsp;Shelvey đ&atilde; may mắn ở pha b&oacute;ng n&agrave;y.&quot;</em></p>\r\n\r\n<p>Trước đ&oacute;, trọng t&agrave;i&nbsp;Mark Clattenburg cũng tuy&ecirc;n bố,&nbsp;Shelvey đ&atilde;&nbsp;đ&aacute; Pogba từ ph&iacute;a sau bằng cả gầm gi&agrave;y v&agrave; điều n&agrave;y g&acirc;y nguy hiểm cho sự an to&agrave;n của đối phương.</p>\r\n\r\n<p><strong>Video t&agrave;i năng của Pogba:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tiểu Lam | 06:46 04/01/2019</p>\r\n', 'AnhTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(28, 'ducdeptrai', , 'Đội hình 11 cầu thủ đắt giá nhất: Song sát PSG \"cân\" cả thế giới', 'Mới đây trang Transfermarkt vừa chọn ra 11 cái tên đắt giá nhất hiện tại. PSG hiện đang sở hữu 2 tiền đạo cực khủng là Neymar và Mbappe.', '<p>&nbsp;Mới đ&acirc;y trang Transfermarkt vừa chọn ra 11 c&aacute;i t&ecirc;n đắt gi&aacute; nhất hiện tại. PSG hiện đang sở hữu 2 tiền đạo cực khủng l&agrave; Neymar v&agrave; Mbappe.</p>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/1-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Thủ m&ocirc;n: Ter Stegen (80 triệu euro) - Ng&ocirc;i sao người Đức lu&ocirc;n cho thấy phong độ ổn định v&agrave; khả năng nhạy b&eacute;n, thậm ch&iacute; xuất thần trong nhiều t&igrave;nh huống. Hiện tại, vai tr&ograve; của anh với Barca kh&ocirc;ng hề k&eacute;m si&ecirc;u sao Leo</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/2-1845.jpg\" width=\"620\" /></p>\r\n\r\n<h2>&nbsp;Hậu vệ phải: Joshua Kimmich (60 triệu euro) - T&agrave;i năng trẻ người Đức c&oacute; sự thăng tiến vượt bậc trong v&agrave;i năm qua. Anh được xem l&agrave; người thừa kế vị tr&iacute; bỏ lại của huyền thoại Philipp Lahm trong m&agrave;u &aacute;o c&acirc;u lạc bộ lẫn đội tuyển quốc gia.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/3-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Trung vệ: Van Dijk (75 triệu euro) - Quyết định bỏ ra số tiền kỷ lục 75 triệu bảng chỉ để chi&ecirc;u mộ một trung vệ của Liverpool l&uacute;c n&agrave;y đang tỏ ra đ&uacute;ng đắn khi Virgil Van Dijk đang đ&oacute;ng vai tr&ograve; &quot;h&ograve;n đ&aacute; tảng&quot; nơi h&agrave;ng thủ The Kop l&uacute;c n&agrave;y. Hiện đo&agrave;n qu&acirc;n của HLV Jurgen Klopp chỉ để thủng lưới 7 b&agrave;n sau 19 v&ograve;ng đấu Premier League.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/4-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Trung vệ: Raphael Varane (80 triệu euro) &ndash; Varane c&oacute; một năm thi đấu th&agrave;nh c&ocirc;ng khi anh l&agrave; nh&acirc;n tố ch&iacute;nh v&ocirc; địch Champions League c&ugrave;ng Real Madrid v&agrave; đoạt c&uacute;p v&agrave;ng World Cup c&ugrave;ng tuyển Ph&aacute;p.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/5-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Hậu vệ tr&aacute;i: Marcelo (70 triệu euro) &ndash; Cầu thủ người Brazil đ&oacute;ng vai tr&ograve; then chốt gi&uacute;p Real Madrid thống trị ch&acirc;u &Acirc;u trong 3 m&ugrave;a vừa qua. Mặc d&ugrave; vẫn bị chỉ tr&iacute;ch v&igrave; thường xuy&ecirc;n bỏ vị tr&iacute;, tuy nhi&ecirc;n mọi h&agrave;ng ph&ograve;ng ngự đều phải e d&egrave; khi Marcelo d&acirc;ng cao tấn c&ocirc;ng.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/6-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tiền vệ ph&ograve;ng ngự: N&rsquo;Golo Kante (100 triệu euro) &ndash; Mặc d&ugrave; đ&atilde; đ&aacute;nh mất vị tr&iacute; mỏ neo v&agrave;o tay Jorginho, tuy nhi&ecirc;n Kante hiện tại vẫn đang được đ&aacute;nh gi&aacute; rất cao bởi thể lực sung m&atilde;n v&agrave; khả năng &ldquo;c&agrave;n qu&eacute;t&rdquo; tuyệt vời ở giữa s&acirc;n.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/7-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tiền vệ trung t&acirc;m: De Bruyne (150 triệu euro) &ndash; Kh&ocirc;ng c&oacute; cơ hội thể hiện nhiều ở m&ugrave;a n&agrave;y bởi d&iacute;nh chấn thương li&ecirc;n mi&ecirc;n, tuy nhi&ecirc;n kh&ocirc;ng ai d&aacute;m phủ nhận t&agrave;i năng của &ldquo;Vua kiến tạo&rdquo; Premier League m&ugrave;a trước.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/8-1845.jpg\" width=\"590\" /></p>\r\n\r\n<h2>&nbsp;Tiền vệ tấn c&ocirc;ng: Eden Hazard (150 triệu euro) &ndash; Hiện cầu thủ người Bỉ đang l&agrave; niềm cảm hứng trong lối chơi tấn c&ocirc;ng của Chelsea. Hazard cũng đang nằm trong mục ti&ecirc;u chuyển nhượng của Real Madrid.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/9-1845.jpg\" width=\"640\" /></p>\r\n\r\n<h2>&nbsp;Tiền đạo phải: Lionel Messi (160 triệu euro) &ndash; Si&ecirc;u sao người Argentina vẫn đang cho thấy đẳng cấp kh&aacute;c biệt với phần c&ograve;n lại. Tuy nhi&ecirc;n gi&aacute; trị của Messi bị ảnh hưởng bởi anh đ&atilde; 31 tuổi.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/10-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tiền đạo tr&aacute;i: Neymar (180 triệu euro) &ndash; Gi&aacute; trị của Neymar c&oacute; phần giảm s&uacute;t bởi anh chơi kh&ocirc;ng th&agrave;nh c&ocirc;ng ở m&ugrave;a giải năm ngo&aacute;i trong m&agrave;u &aacute;o PSG v&agrave; tuyển Brazil.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/11-1845.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Tiền đạo cắm: Kylian Mbappe (200 triệu euro) - &nbsp;Việc li&ecirc;n tiếp gi&agrave;nh danh hiệu Cậu b&eacute; v&agrave;ng, Cầu thủ trẻ hay nhất World Cup, Cầu thủ trẻ xuất sắc nhất năm cũng như những m&agrave;n toả s&aacute;ng rực rỡ trong m&agrave;u &aacute;o PSG v&agrave; tuyển Ph&aacute;p, Mbappe được định gi&aacute; cao nhất thế giới hiện nay.</h2>\r\n\r\n<p><img alt=\"Đội hình đắt giá nhất theo Transfermarkt - Bóng Đá\" src=\"http://media.bongda.com.vn/files/duong.nguyen/2018/12/29/12-1845.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Đội h&igrave;nh 11 cầu thủ đắt gi&aacute; nhất do&nbsp;Transfermarkt b&igrave;nh chọn.</h2>\r\n', 'AnhDucTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(29, 'ducdeptrai', , 'Chính thức! \"Effenberg đệ nhị\" chia tay Dortmund', 'Dortmund đã nói lời chia tay với tiền vệ trung tâm Sebastian Rode trong giai đoạn còn lại của mùa giải.', '<p>Trưởng th&agrave;nh từ l&ograve; đ&agrave;o tạo trẻ của&nbsp;Kickers Offenbach, g&acirc;y tiếng vang ở&nbsp;Eintracht Frankfurt trước khi khiến cả thế giới ch&uacute; &yacute; khi đầu qu&acirc;n cho &quot;g&atilde; khổng lồ nước Đức&quot;, Bayern Munich, sự nghiệp của Sebastian Rode tựa như một bản giao hưởng với rất nhiều những nốt thăng dẫn dắt anh đến đỉnh cao của l&agrave;ng b&oacute;ng đ&aacute; xứ German.</p>\r\n\r\n<p>Sở hữu lối chơi mạnh mẽ, khả năng tranh chấp ấn tượng, những c&uacute; s&uacute;t xa tr&aacute;i ph&aacute; c&ugrave;ng phong c&aacute;ch quyết liệt, kh&ocirc;ng khoan nhượng, tiền vệ 28 tuổi từng được kỳ vọng sẽ trở th&agrave;nh một &quot;Stefan Effenberg đệ nhị&quot; ở s&acirc;n Allianz Arena. Đặc biệt khi ngay ở m&ugrave;a b&oacute;ng đầu ti&ecirc;n c&ugrave;ng &quot;H&ugrave;m x&aacute;m&quot;, anh đ&atilde; ra s&acirc;n trong 35 trận v&agrave; đ&oacute;ng g&oacute;p 3 b&agrave;n thắng cho đội b&oacute;ng xứ Bavaria.&nbsp;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, đ&uacute;ng thời điểm&nbsp;<a href=\"http://www.bongda.com.vn/Sebastian+Rode-search/\" target=\"_blank\">Rode</a>&nbsp;đang chơi hay v&agrave; đang dần khẳng định m&igrave;nh tr&ecirc;n bản đồ b&oacute;ng đ&aacute; thế giới th&igrave; bước ngoặt lại xảy đến. Chấn thương khiến tiền vệ 28 tuổi chỉ c&ograve;n ra s&acirc;n 17 trận cho Bayern Munich v&agrave; khi anh trở lại, khu trung tuyến chật chội của HLV Pep Guardiola với những c&aacute;i t&ecirc;n lừng danh như Xabi Alonso, Thiago Alcantara, Arturo Vidal hay Philipp Lahm đ&atilde; khiến anh kh&ocirc;ng c&ograve;n cơ hội t&igrave;m lại vị thế xưa cũ của m&igrave;nh.&nbsp;</p>\r\n\r\n<p><img alt=\"Chính thức! \" src=\"http://media.bongda.com.vn/files/trong.le/2018/12/28/rode-2-1221.jpg\" width=\"680\" /></p>\r\n\r\n<h2>Rode từng được kỳ vọng sẽ trở th&agrave;nh &quot;Effenberg đệ nhị&quot; ở Bayern Munich tuy nhi&ecirc;n v&igrave; những l&yacute; do kh&aacute;c nhau, anh đ&atilde; đ&aacute;nh mất vị tr&iacute; của m&igrave;nh tại Allianz Arena.&nbsp;</h2>\r\n\r\n<p>Khi c&oacute; được 100% phong độ v&agrave; thể lực, Rode đ&oacute;ng vai tr&ograve; l&agrave; một &quot;qu&acirc;n b&agrave;i chiến lược&quot; của chiến lược gia người T&acirc;y Ban Nha. Nhưng khi trở lại sau chấn thương v&agrave; cần thời gian để t&igrave;m lại ch&iacute;nh m&igrave;nh, anh chẳng kh&aacute;c n&agrave;o một &quot;người thừa&quot; ở Bayern Munich khi đ&atilde; ho&agrave;n to&agrave;n &quot;lỡ nhịp&quot; trong ch&iacute;nh bản giao hưởng cuộc đời.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kh&aacute;c với Javi Martinez, một &quot;c&ocirc;ng thần&quot; Bayern kh&aacute;c chấp nhận ở lại Allianz Arena để &quot;truy kiếm&quot; thời ho&agrave;ng kim, Rode kh&ocirc;ng chấp nhận t&igrave;nh cảnh hiện tại v&agrave; anh đ&atilde; quyết định&nbsp;<a href=\"http://www.bongda.com.vn/sebastian-rode-roi-bayern-gia-nhap-dortmund-d348410.html\" target=\"_blank\">gia nhập đại k&igrave;nh địch</a>&nbsp;của &quot;H&ugrave;m x&aacute;m&quot; khi đ&oacute;,&nbsp;<a href=\"http://www.bongda.com.vn/Borussia+Dortmund-search/\" target=\"_blank\">Borussia Dortmund</a>.&nbsp;</p>\r\n\r\n<p>Đến với Signal Iduna Park, cầu thủ người Đức một lần nữa lại khẳng định t&agrave;i năng khi được HLV Thomas Tuchel tin tưởng v&agrave; đ&oacute;ng vai tr&ograve; như &quot;thủ lĩnh&quot; tuyến giữa của c&acirc;u lạc bộ &quot;V&agrave;ng v&agrave; đen&quot;.</p>\r\n\r\n<p><img alt=\"Chính thức! \" src=\"http://media.bongda.com.vn/files/trong.le/2018/12/28/rode-1-1221.jpg\" width=\"680\" /></p>\r\n\r\n<h2>Gia nhập Dortmund, Rode đ&atilde; từng c&oacute; khoảng thời gian th&agrave;nh c&ocirc;ng nhưng cũng kh&ocirc;ng &iacute;t lần nếm m&ugrave;i cay đắng. Hiện tại, anh đ&atilde; chọn gia nhập Frankfurt theo dạng cho mượn đến hết m&ugrave;a giải.&nbsp;&nbsp;</h2>\r\n\r\n<p>Tuy nhi&ecirc;n, giữa l&uacute;c &aacute;nh s&aacute;ng hy vọng trở lại, sự trớ tr&ecirc;u của cuộc đời một lần nữa lại &quot;d&igrave;m&quot; Rode xuống vực s&acirc;u khi ngay ở m&ugrave;a tiếp theo, HLV Peter Stoger kh&ocirc;ng trọng dụng anh v&agrave; &quot;Effenberg đệ nhị&quot; một lần nữa phải nếm m&ugrave;i cay đắng khi chấp nhận th&acirc;n phận dự bị ở Dortmund.</p>\r\n\r\n<p>Để rồi đến giờ đ&acirc;y, sau một khoảng thời gian đ&agrave;m ph&aacute;n, Rode đ&atilde; đạt được thỏa thuận rời Signal Iduna Park để&nbsp;<strong>trở về &quot;m&aacute;i nh&agrave; xưa&quot; Frankfurt theo dạng cho mượn</strong>&nbsp;đến hết m&ugrave;a giải.&nbsp;</p>\r\n\r\n<p>Ng&agrave;y ra đi, Dortmund đ&atilde; gửi lời cảm ơn đến anh v&agrave; hy vọng &quot;Effenberg đệ nhị&quot; c&oacute; thể t&igrave;m lại ch&iacute;nh m&igrave;nh ở đội b&oacute;ng bang Hessen. C&ograve;n với Rode, khi đ&atilde; tiệm cận tuổi 30, tiền vệ người Đức n&ecirc;n hiểu rằng, anh sẽ&nbsp;kh&ocirc;ng c&ograve;n nhiều thời gian để c&oacute; thể phi&ecirc;u lưu với sự nghiệp như&nbsp;trước đ&oacute; nữa.&nbsp;</p>\r\n\r\n<p>Phi Yến | 11:12 28/12/2018</p>\r\n', 'AnhDucC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(30, 'ducdeptrai', , 'Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): Người hùng MU, sao Liver có 1 vị trí', 'Dưới đây là 10 ngôi sao xếp từ vị trí thứ 20 đến 11 trong danh sách những cái tên xuất sắc nhất thế giới 2018 theo bình chọn của Four Four Two.', '<p>&nbsp;Dưới đ&acirc;y l&agrave; 10 ng&ocirc;i sao xếp từ vị tr&iacute; thứ 20 đến 11 trong danh s&aacute;ch những c&aacute;i t&ecirc;n xuất sắc nhất thế giới 2018 theo b&igrave;nh chọn của Four Four Two.</p>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/ste-0247.jpg\" width=\"630\" /></p>\r\n\r\n<h2>20. Marc-Andre ter Stegen: Kh&ocirc;ng c&oacute; g&igrave; đ&aacute;ng b&agrave;n c&atilde;i về t&agrave;i năng c&ugrave;ng phong độ của Stegen ở thời điểm hiện tại. Với biệt danh &quot;Messi thủ m&ocirc;n&quot;, ng&ocirc;i sao người Đức ng&agrave;y c&agrave;ng cho thấy tầm quan trọng với Barcelona. Khi&ecirc;m tốn, giản dị cộng với khả năng, kỹ thuật thượng thừa, tuyển thủ số 1 từng bước khẳng định vị thế trong l&agrave;ng t&uacute;c cầu lẫn l&ograve;ng người h&acirc;m mộ.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/i5-0246.jpg\" width=\"630\" /></p>\r\n\r\n<h2>19. Virgil van Dijk: Xuất sắc, ấn tượng, thuyết phục l&agrave; tất cả những từ ngữ d&agrave;nh tặng Van Dijk. Kh&ocirc;ng cần qu&aacute; nhiều thời gian, tuyển thủ người H&agrave; Lan đ&atilde; g&acirc;y được tiếng vang tại Premier League, đồng thời đ&aacute;p trả gay gắt những d&egrave; bỉu về t&agrave;i năng của anh. Hiện tại, ng&ocirc;i sao số 4 nghiễm nhi&ecirc;n trở th&agrave;nh trụ cột của Liverpool v&agrave; l&agrave; ch&igrave;a kh&oacute;a th&agrave;nh c&ocirc;ng với đội nh&agrave; suốt chặng đường qua.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d9-0248.jpg\" width=\"630\" /></p>\r\n\r\n<h2>18. Mauro Icardi: Icardi c&oacute; được vị tr&iacute; n&agrave;y đơn giản v&igrave; anh xứng đ&aacute;ng. Ng&ocirc;i sao Argentina li&ecirc;n tục khuấy đảo Serie A bằng nỗ lực, sự vươn l&ecirc;n v&agrave; t&agrave;i năng của bản th&acirc;n. Việc kh&ocirc;ng thể tham dự World Cup 2018 r&otilde; r&agrave;ng kh&ocirc;ng ảnh hưởng đến sự xuất sắc của ch&acirc;n s&uacute;t Nam Mỹ. Suốt 1 năm qua, những g&igrave; tiền đạo số 9 đ&oacute;ng g&oacute;p cho Inter l&agrave; đ&aacute;ng khen ngợi.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d4-0248.jpg\" width=\"630\" /></p>\r\n\r\n<h2>17. Robert Lewandowski: Bất chấp những ồn &agrave;o, l&ugrave;m x&ugrave;m về chuyện đi ở, Lewandowski vẫn l&agrave; trụ cột chủ chốt của Bayern Munich. Ng&ocirc;i sao Ba Lan lu&ocirc;n giữ vững phong độ v&agrave; nằm trong top c&aacute;c trung phong cắm h&agrave;ng đầu l&agrave;ng t&uacute;c cầu. Hiện tại, tiền đạo 30 tuổi đang cạnh tranh danh hiệu &quot;Vua ph&aacute; lưới&quot; Bundesliga với 10 b&agrave;n thắng sau 16 v&ograve;ng đấu.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/u-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>16. David de Gea: C&oacute; qu&aacute; nhiều điều để n&oacute;i về De Gea. Cầu thủ chủ chốt, điểm tựa nơi khung gỗ, người h&ugrave;ng của Manchester United, tất cả đều đ&uacute;ng về ng&ocirc;i sao T&acirc;y Ban Nha. Ở tuyển thủ 28 tuổi, người ta lu&ocirc;n thấy được tinh thần thi đấu nhiệt huyết, cống hiến. Đ&oacute; l&agrave; l&yacute; do tại sao anh vẫn g&aacute;nh v&aacute;c đội nh&agrave; d&ugrave; li&ecirc;n tục vướng l&ugrave;m x&ugrave;m ra đi.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d3-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>15. Luis Suarez: Phong độ Suarez năm 2018 li&ecirc;n tục g&acirc;y tranh c&atilde;i. Tuyển thủ người Uruguay kh&ocirc;ng &iacute;t lần sa s&uacute;t v&agrave; thi đấu tệ hại. Thế nhưng, c&ocirc;ng bằng m&agrave; n&oacute;i, tiền đạo số 9 vẫn sở hữu sự nhạy b&eacute;n v&agrave; khả năng săn b&agrave;n đ&aacute;ng gờm. Ng&ocirc;i sao Nam Mỹ lu&ocirc;n biết cố gắng tập luyện, thay đổi, nỗ lực để trở lại v&agrave; dập tắt mọi sự nghi ngờ.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/t-0249.jpg\" width=\"630\" /></p>\r\n\r\n<h2>14. Kevin de Bruyne: Vừa qua, ESPN đ&aacute;nh gi&aacute; De Bruyne l&agrave; tiền vệ c&ocirc;ng xuất sắc nhất l&agrave;ng t&uacute;c cầu thời điểm hiện tại. Hiển nhi&ecirc;n, m&agrave;n tr&igrave;nh diễn v&agrave; t&agrave;i năng của ng&ocirc;i sao người Bỉ đ&atilde; được chứng minh suốt thời gian qua. Nh&atilde;n quan chiến thuật v&agrave; tư duy hơn người gi&uacute;p tuyển thủ số 17 trở th&agrave;nh con &aacute;t chủ b&agrave;i tr&ecirc;n con đường th&agrave;nh c&ocirc;ng của Pep v&agrave; Man City.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/m1-0251.jpg\" width=\"630\" /></p>\r\n\r\n<h2>13.&nbsp;N&#39;Golo Kant&eacute;: Kante l&agrave; c&aacute;i t&ecirc;n l&agrave;m mưa l&agrave;m gi&oacute; l&agrave;ng t&uacute;c cầu suốt thời gian qua. Ng&ocirc;i sao người Ph&aacute;p trở th&agrave;nh cơn &aacute;c mộng với bất cứ h&agrave;ng tiền đạo n&agrave;o khi anh lu&ocirc;n biết c&aacute;ch khắc chế v&agrave; kh&oacute;a chặt đối phương. Th&agrave;nh c&ocirc;ng của Les Bleus tại World Cup 2018 đến từ sự cống hiến kh&ocirc;ng nhỏ của tiền vệ số 7.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/d1-0250.jpg\" width=\"630\" /></p>\r\n\r\n<h2>12.&nbsp;Sergio Aguero: Aguero đang trở th&agrave;nh c&acirc;y săn b&agrave;n kh&eacute;t tiếng ở Ngoại hạng Anh. Tuyển thủ người Argentina li&ecirc;n tục lập kỷ lục khi m&ugrave;a giải 2018/2019 chỉ vừa tr&ocirc;i qua được 1/3 chặng đường. Hiện tại, tiền đạo số 10 đ&atilde; trở th&agrave;nh 1 phần kh&ocirc;ng thể thay thế ở Man City.</h2>\r\n\r\n<p><img alt=\"Top 30 ngôi sao xuất sắc nhất năm 2018 (phần 2): - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2018/12/22/t2-0250.jpg\" width=\"630\" /></p>\r\n\r\n<h2>11. David Silva: &quot;Gừng c&agrave;ng gi&agrave; c&agrave;ng cay&quot;, c&acirc;u n&agrave;y ho&agrave;n to&agrave;n đ&uacute;ng với trường hợp của David Silva. Ng&ocirc;i sao người T&acirc;y Ban Nha ở tuổi 32 vẫn cho thấy được t&agrave;i năng c&ugrave;ng những t&igrave;nh huống xử l&yacute;, kiểm so&aacute;t hơn người. Việc De Bruyne vắng mặt suốt thời gian qua, tiền vệ xứ b&ograve; t&oacute;t c&agrave;ng c&oacute; đất diễn v&agrave; g&aacute;nh v&aacute;c tuyến giữa v&ocirc; c&ugrave;ng xuất sắc. Vị tr&iacute; h&ocirc;m nay l&agrave; phần thưởng xứng đ&aacute;ng cho Silva.</h2>\r\n\r\n<p>Bạch Băng | 09:00 22/12/2018</p>\r\n', 'AnhPhapDucYTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(31, 'ducdeptrai', , 'Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm', 'Jadon Sancho và Marco Reus đã toả sáng trong một trận cầu rất khó khăn dành cho Dortmund.', '<p>Jadon Sancho v&agrave; Marco Reus đ&atilde; toả s&aacute;ng trong một trận cầu rất kh&oacute; khăn d&agrave;nh cho Dortmund.</p>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s2-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Dortmund đụng độ&nbsp;Gladbach l&agrave; trận đấu đ&aacute;ng ch&uacute; &yacute; nhất ở v&ograve;ng 17 Bundesliga bởi đ&acirc;y l&agrave; 2 đội b&oacute;ng đang chia sẻ ng&ocirc;i đầu bảng.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s1-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Trận cầu diễn ra cực kỳ kịch t&iacute;nh ngay từ khi tiếng c&ograve;i khai cuộc của trọng t&agrave;i vang l&ecirc;n.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s0-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Ph&uacute;t 34, Dortmund gặp tổn thất lớn khi ch&acirc;n s&uacute;t đang v&agrave;o phom&nbsp;Alcacer d&iacute;nh chấn thương nặng v&agrave; buộc phải rời s&acirc;n nhường chỗ cho Mario Gotze.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s5-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Chỉ &iacute;t ph&uacute;t sau khi v&agrave;o s&acirc;n, Gotze đ&atilde; c&oacute; pha kiến tạo để thần đồng nước Anh&nbsp;Jadon Sancho lập c&ocirc;ng mở tỷ số cho Dortmund.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s6-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Sancho đang thi đấu qu&aacute; hay.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s9-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tuy nhi&ecirc;n,&nbsp;3 ph&uacute;t sau Gladbach đ&atilde; c&oacute; b&agrave;n gỡ ho&agrave; do c&ocirc;ng của&nbsp;Christoph Kramer.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s10-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Trận đấu trở về vạch xuất ph&aacute;t sau khi kết th&uacute;c hiệp 1.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/3-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Sang hiệp 2,&nbsp;tiền vệ Gotze ho&agrave;n tất c&uacute; đ&uacute;p kiến tạo để Marco Reus ghi b&agrave;n, đưa đội nh&agrave; vượt l&ecirc;n dẫn trước 2-1 ở ph&uacute;t 54.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s4-0711.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Gotze quả thực l&agrave; thần may mắn của Dortmund trận n&agrave;y.</h2>\r\n\r\n<p><img alt=\"Sancho, Reus giúp Dortmund thiết lập lại khoảng cách 9 điểm - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/22/s7-0711.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Tỷ số trận đấu được giữ nguy&ecirc;n, Dortmund hạ Gladbach để củng cố ng&ocirc;i vị đầu bảng với 9 điểm nhiều hơn đối thủ v&agrave; Bayern Munich (chưa đ&aacute;).</h2>\r\n\r\n<p><strong>Đội h&igrave;nh ra s&acirc;n:</strong></p>\r\n\r\n<p><em><strong>Dortmund</strong></em>: B&uuml;rki - Piszczek, Weigl, Toprak, Hakimi - Witsel, Delaney &ndash; Sancho (Wolf 90+2&rsquo;), Reus (c), Guerreiro (Bruun Larsen 90+3&rsquo;) &ndash; Alcacer (G&ouml;tze 34&rsquo;)</p>\r\n\r\n<p><em><strong>M&ouml;nchengladbach</strong></em>: Sommer - Johnson, Beyer, Strobl, Wendt (c) &ndash; Kramer (Hofmann 68&rsquo;), Zakaria, Neuhaus (Cuisance 81&rsquo;) - Hazard, Plea, Herrmann (Traore 73&rsquo;)</p>\r\n\r\n<p><em>Ghi b&agrave;n:</em>&nbsp;1-0 Sancho (42&rsquo;), 1-1 (Kramer 45+1), 2-1 (Reus 54&rsquo;)</p>\r\n\r\n<p><strong>Video tổng hợp diễn biến trận đấu&nbsp;Borussia Dortmund 2-1 Borussia M&ouml;nchengladbach:</strong></p>\r\n', 'AnhDucTBNC1', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(32, 'ducdeptrai', , 'Lão tướng lên tiếng, Bayern Munich phả hơi nóng vào gáy Dortmund', 'Bayern Munich rút ngắn cách biệt với Dortmund, qua đó khiến cuộc đua Bundesliga trở nên hấp dẫn hơn bao giờ hết.', '<h1><a href=\"http://www.bongda.com.vn/lao-tuong-len-tieng-bayern-munich-pha-hoi-nong-vao-gay-dortmund-d477884.html\">L&atilde;o tướng l&ecirc;n tiếng, Bayern Munich phả hơi n&oacute;ng v&agrave;o g&aacute;y Dortmund</a></h1>\r\n\r\n<p>08:28 Thứ năm 20/12/2018</p>\r\n\r\n<p>BongDa.com.vn&nbsp;Bayern Munich r&uacute;t ngắn c&aacute;ch biệt với Dortmund, qua đ&oacute; khiến cuộc đua Bundesliga trở n&ecirc;n hấp dẫn hơn bao giờ hết.</p>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s6-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Bayern Munich&nbsp;bước v&agrave;o trận đấu gặp&nbsp;RB Leipzig với tin vui khi Dortmund bất ngờ gục ng&atilde; ở v&ograve;ng&nbsp;16 Bundesliga.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s5-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Thế nhưng Leipzig kh&ocirc;ng phải đối thủ dễ chịu. Họ li&ecirc;n tục g&acirc;y ra nhiều kh&oacute; khăn cho H&ugrave;m x&aacute;m ngay tại th&aacute;nh địa Allianz Arena.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s3-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Bayern Munich gặp bế tắc trong việc tiếp cận khung th&agrave;nh đối phương sau gần 1 tiếng rưỡi đồng hồ thi đấu.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s4-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Phải tới ph&uacute;t 83, Bayern Munich mới c&oacute; được niềm vui khi l&atilde;o tướng Franck&nbsp;Ribery c&oacute; c&uacute; dứt điểm th&agrave;nh c&ocirc;ng trong v&ograve;ng cấm.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s7-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;B&agrave;n thắng đẩy trận đấu trở n&ecirc;n kịch t&iacute;nh ở những ph&uacute;t cuối. Ph&uacute;t 90+1,&nbsp;Leipzig chỉ c&ograve;n thi đấu với 10 người bởi&nbsp; Ilsanker phải nhận thẻ đỏ rời s&acirc;n.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s1-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;Tiếp theo sau đ&oacute;, tới lượt&nbsp;Renato Sanches cũng bị trọng t&agrave;i truất quyền thi đấu.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s2-0742.jpg\" width=\"634\" /></p>\r\n\r\n<h2>&nbsp;D&ugrave; vậy, Bayern Munich vẫn bảo to&agrave;n được tỷ số 1-0, qua đ&oacute; gi&agrave;nh được 3 điểm cực kỳ quan trọng.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s8-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Với kết quả n&agrave;y,&nbsp;Bayern Munich đứng thứ 3 tr&ecirc;n bảng xếp hạng nhưng đ&atilde; thu ngắn c&aacute;ch biệt với Dortmund xuống c&ograve;n 6 điểm.</h2>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/hai.phan/2018/12/20/s9-0742.jpg\" width=\"680\" /></p>\r\n\r\n<h2>&nbsp;Dortmund thất bại với tỷ số 1-2 trước&nbsp;Dusseldorf mở ra cơ hội b&aacute;m đuổi cho Bayern Munich khi c&aacute;ch biệt hiện giờ chỉ c&ograve;n l&agrave; 6 điểm m&agrave; m&agrave; giải vẫn c&ograve;n kh&aacute; d&agrave;i.</h2>\r\n', 'DucC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(33, 'ducdeptrai', , 'Bảo vệ đồng đội, Ronaldo cãi nhau tay đôi với trọng tài', 'Siêu sao Bồ Đào Nha tỏ ra vô cùng không hài lòng với người điều khiển trận đấu ở tình huống đội nhà chịu thiệt.', '<h1><a href=\"http://www.bongda.com.vn/bao-ve-dong-doi-ronaldo-cai-nhau-tay-doi-voi-trong-tai-d479091.html\">Bảo vệ đồng đội, Ronaldo c&atilde;i nhau tay đ&ocirc;i với trọng t&agrave;i</a></h1>\r\n\r\n<p>21:31 Thứ bảy 29/12/2018</p>\r\n\r\n<p>BongDa.com.vn&nbsp;Si&ecirc;u sao Bồ Đ&agrave;o Nha tỏ ra v&ocirc; c&ugrave;ng kh&ocirc;ng h&agrave;i l&ograve;ng với người điều khiển trận đấu ở t&igrave;nh huống đội nh&agrave; chịu thiệt.</p>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/y-2059.jpg\" width=\"629\" /></p>\r\n\r\n<h2>&nbsp;Trong khu&ocirc;n khổ V&ograve;ng 19 Serie A, Juventus tiếp đ&oacute;n Sampdoria tr&ecirc;n s&acirc;n nh&agrave; Allianz.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/h-2118.jpg\" width=\"618\" /></p>\r\n\r\n<h2>&nbsp;Bianconeri ch&agrave;o đ&oacute;n sự trở lại của Cristiano Ronaldo, trụ cột được HLV Max Allegri cho nghỉ dưỡng sức v&agrave; chỉ v&agrave;o s&acirc;n từ băng ghế dự bị ở m&agrave;n chạm tr&aacute;n Atalanta c&aacute;ch đ&acirc;y &iacute;t ng&agrave;y.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/4-2107.jpg\" width=\"865\" /></p>\r\n\r\n<h2>&nbsp;Khi c&aacute;c kh&aacute;n giả c&ograve;n chưa ấm chỗ, CR7 đ&atilde; l&ecirc;n tiếng. Ph&uacute;t thứ 2, tận dụng đường phất b&oacute;ng giữa s&acirc;n ch&iacute;nh x&aacute;c của Paulo Dybala, Ronaldo xử l&yacute; chớp nho&aacute;ng v&agrave; kết th&uacute;c ho&agrave;n hảo bằng c&uacute; s&uacute;t ch&igrave;m đập đất tung lưới Sampdoria, mở tỷ số trận đấu.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/f-2108.jpg\" width=\"625\" /></p>\r\n\r\n<h2>&nbsp;Sau b&agrave;n thắng, Juve kiểm so&aacute;t b&oacute;ng nhiều nhưng kh&ocirc;ng mấy hiệu quả. Ph&uacute;t 29, đội kh&aacute;ch bất ngờ được hưởng phạt đền v&igrave; Emre Can để b&oacute;ng chạm tay trong v&ograve;ng cấm. Tr&ecirc;n chấm 11 m&eacute;t,&nbsp;Fabio Quagliarella lạnh l&ugrave;ng hạ gục&nbsp;Mattia Perin san bằng c&aacute;ch biệt.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/t-2109.jpg\" width=\"617\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo cật lực phản đối quyết định của trọng t&agrave;i&nbsp;Paolo Valeri, do anh cho rằng Can kh&ocirc;ng hề cố &yacute; trong t&igrave;nh huống bay người ph&ograve;ng ngự.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/g-2109.jpg\" width=\"617\" /></p>\r\n\r\n<h2>&nbsp;Cuối hiệp một, Paulo Dybala đi b&oacute;ng v&agrave; dứt điểm kh&eacute;o l&eacute;o, nhưng bị thủ m&ocirc;n&nbsp;Emil Audero đổ người ngăn chặn.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/s-2109.jpg\" width=\"876\" /></p>\r\n\r\n<h2>&nbsp;Đầu hiệp hai, Blaise Matuidi v&agrave; Matuidi li&ecirc;n tiếp tung ra 2 c&uacute; s&uacute;t xa nguy hiểm, nhưng đều bị&nbsp;Audero phản xạ xuất thần cản ph&aacute;.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/ff-2112.jpg\" width=\"618\" /></p>\r\n\r\n<h2>&nbsp;Sức &eacute;p khủng khiếp Juve tạo ra cuối c&ugrave;ng đ&atilde; khiến Sampdoria mắc sai lầm. Ph&uacute;t 62, đến lượt đội chủ nh&agrave; được hưởng phạt đền v&igrave;&nbsp;Alex Ferrari để b&oacute;ng chạm tay trong v&ograve;ng cấm. Tr&ecirc;n chấm lu&acirc;n lưu, Ronaldo s&uacute;t thẳng v&agrave;o giữa khung th&agrave;nh, đ&aacute;nh lừa hướng ph&aacute;n đo&aacute;n của Audero t&aacute;i lập thế dẫn trước.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/a-2111.jpg\" width=\"621\" /></p>\r\n\r\n<h2>&nbsp;Kịnh t&iacute;nh tăng cao ở những ph&uacute;t cuối trận, khi&nbsp;Riccardo Saponara v&agrave;o thay người l&agrave;m cả cầu trường Allianz c&acirc;m lặng bằng c&uacute; cứa l&ograve;ng tung lưới&nbsp;Perin.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/cats-2115.jpg\" width=\"619\" /></p>\r\n\r\n<h2>&nbsp;Tuy thế sau khi tham khảo băng h&igrave;nh VAR, trọng t&agrave;i&nbsp;Valeri lại kh&ocirc;ng c&ocirc;ng nhận b&agrave;n thắng.</h2>\r\n\r\n<p><img alt=\"ẢNH ST - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/kk-2116.jpg\" width=\"615\" /></p>\r\n\r\n<h2>&nbsp;Giữ vững tỷ số 2-1, Juve kết th&uacute;c lượt đi Serie A với th&agrave;nh t&iacute;ch bất bại c&ugrave;ng ng&ocirc;i đầu vững chắc.</h2>\r\n', 'PhapYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(34, 'hoduc17', , 'Ronaldo bùng nổ lập cú đúp, Juventus khép lại nửa đầu mùa giải hoàn hảo', 'Với điểm tựa Allianz, Bianconeri chính thức đóng lại giai đoạn lượt đi bằng thành tích bất bại.', '<p>Tiếp đ&oacute;n Sampdoria trong khu&ocirc;n khổ lượt trận cuối lượt đi Serie A, Juventus đ&oacute;n ch&agrave;o sự trở lại của Cristiano Ronaldo trong đội h&igrave;nh xuất ph&aacute;t. Kh&ocirc;ng mất qu&aacute; nhiều thời gian&nbsp;<a href=\"http://www.bongda.com.vn/thach-messi-den-serie-a-khon-nhu-ronaldo-d478948.html\" target=\"_blank\">đế CR7 tạo ra dấu ấn</a>.</p>\r\n\r\n<p>Ngay ph&uacute;t thứ 2, Paulo Dybala thực hiện đường phất b&oacute;ng điệu nghệ từ giữa s&acirc;n, t&igrave;m đến ch&iacute;nh x&aacute;c vị tr&iacute; Ronaldo trước r&igrave;a v&ograve;ng cấm đội kh&aacute;ch. Nhận thấy&nbsp;Jacopo Sala kh&ocirc;ng c&oacute; &yacute; &aacute;p s&aacute;t, CR7 lập tức đẩy b&oacute;ng v&agrave; tung c&uacute; s&uacute;t ch&igrave;m quyết đo&aacute;n nhắm về g&oacute;c xa khung th&agrave;nh Sampdoria. B&oacute;ng đi đập đất kh&oacute; chịu l&agrave;m b&oacute; tay thủ th&agrave;nh&nbsp;Emil Audero.&nbsp;</p>\r\n\r\n<p><img alt=\"st - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/dvlpuccx4aezgwv-2016.jpg\" width=\"1200\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo mở tỷ số.</h2>\r\n\r\n<p>C&oacute; lợi thế sớm, Juve tiếp tục duy tr&igrave; quyền kiểm so&aacute;t, nhưng c&oacute; phần bế tắc trước số đ&ocirc;ng cầu thủ Sampdoria l&ugrave;i s&acirc;u về phần s&acirc;n nh&agrave;. Giữ b&oacute;ng nhiều m&agrave; kh&ocirc;ng tạo ra đột biến, Bianconeri phải trả gi&aacute;.</p>\r\n\r\n<p>Ph&uacute;t 29, xuất ph&aacute;t từ quả phạt g&oacute;c ph&iacute;a&nbsp;<a href=\"http://www.bongda.com.vn/sampdoria-search/\" target=\"_blank\">I Blucerchiati</a>, b&oacute;ng chạm người Emre Can đổi hướng nhắm thẳng về khung th&agrave;nh Juve. Alex Sandro kịp thời ph&aacute; b&oacute;ng tr&ecirc;n vạch v&ocirc;i nhưng sau khi tham khảo băng h&igrave;nh VAR,&nbsp;trọng t&agrave;i Paolo Valeri cho rằng Can đ&atilde; để b&oacute;ng chạm tay v&agrave; cho Sampdoria hưởng phạt đền. Tr&ecirc;n chấm 11 m&eacute;t,&nbsp;Fabio Quagliarella lạnh l&ugrave;ng s&uacute;t thẳng v&agrave;o giữa khung th&agrave;nh, đ&aacute;nh lừa hướng ph&aacute;n đo&aacute;n của&nbsp;Mattia Perin san bằng c&aacute;ch biệt.</p>\r\n\r\n<p>Cuối hiệp một, Juve tạo ra một số t&igrave;nh huống đ&aacute;ng ch&uacute; &yacute;, nhưng cả c&uacute; s&uacute;t xa của Dybala lẫn quả đ&aacute;nh đầu từ đội trưởng Giorgio Chiellini đều kh&ocirc;ng mang về b&agrave;n thắng.&nbsp;<strong>2 đội&nbsp;bước v&agrave;o giờ nghỉ&nbsp;với kết quả 1-1.&nbsp;</strong></p>\r\n\r\n<p>Sang hiệp hai, Juve đẩy cao đội h&igrave;nh dồn &eacute;p đối phương. Ph&uacute;t 52, Blaise Matuidi đ&oacute;n b&oacute;ng bật ra v&agrave; tung ch&acirc;n tốc độ. Tiếc&nbsp;cho tuyển thủ Ph&aacute;p, thủ m&ocirc;n Audero đ&atilde; phản xạ xuất thần từ chối. 7 ph&uacute;t sau, lại l&agrave; những đầu ng&oacute;n tay của&nbsp;Audero đưa b&oacute;ng dội khung gỗ, giải nguy cho Sampdoria sau c&uacute; n&atilde; đại b&aacute;c của Ronaldo.</p>\r\n\r\n<p>Nỗ lực kh&ocirc;ng ngừng nghỉ của đội chủ nh&agrave; cuối c&ugrave;ng cũng được đền đ&aacute;p ở ph&uacute;t 62. Từ pha phạt g&oacute;c ph&iacute;a Juve, Alex Ferrari l&oacute;ng ng&oacute;ng để tay chạm b&oacute;ng khiến đội kh&aacute;ch bị thổi phạt đền. Tương tự&nbsp;Quagliarella,&nbsp;<strong>Ronaldo quyết định s&uacute;t v&agrave;o giữa khung th&agrave;nh khi đứng trước chấm lu&acirc;n lưu.</strong>&nbsp;Audero bay sang tr&aacute;i v&agrave; kh&ocirc;ng thể l&agrave;m g&igrave; hơn ngo&agrave;i v&agrave;o lưới nhặt b&oacute;ng.&nbsp;</p>\r\n\r\n<p><img alt=\"st - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/5-2018.jpg\" width=\"621\" /></p>\r\n\r\n<h2>&nbsp;Vẫn l&agrave; Ronaldo định đoạt kết cục trận đấu.</h2>\r\n\r\n<p>T&aacute;i lập thế dẫn trước,&nbsp;<a href=\"http://www.bongda.com.vn/juventus-search/\" target=\"_blank\">Juve</a>&nbsp;chủ động chơi chậm giữ thế trận. Sampdoria d&ugrave; gắng sức v&ugrave;ng l&ecirc;n nhưng lại qu&aacute; thiếu &yacute; tưởng tiếp cận khung th&agrave;nh đội chủ nh&agrave;. Những tưởng trận đấu đ&atilde; an b&agrave;i th&igrave; bất ngờ ở ph&uacute;t 90+2, cầu thủ v&agrave;o s&acirc;n thay người&nbsp;Riccardo Saponara bất ngờ&nbsp;cứa l&ograve;ng hiểm h&oacute;c khiến Perin ch&ocirc;n ch&acirc;n nh&igrave;n b&oacute;ng bay v&agrave;o lưới. Tuy vậy, sau khi th&ecirc;m 1 lần d&ugrave;ng đến c&ocirc;ng nghệ VAR, trọng t&agrave;i&nbsp;Valeri nhận định số 5 Sampdoria đ&atilde; rơi v&agrave;o thế việt vị trước đ&oacute; v&agrave; b&agrave;n gỡ h&ograve;a kh&ocirc;ng được c&ocirc;ng nhận.</p>\r\n\r\n<p>Bỏ t&uacute;i 3 điểm, Juve kh&eacute;p lại năm 2018 với th&agrave;nh t&iacute;ch bất bại ở nửa đầu m&ugrave;a giải Serie A.</p>\r\n\r\n<p><strong>Chung cuộc:&nbsp;</strong>Juventus 2-1 Sampdoria</p>\r\n\r\n<p><strong>Ghi b&agrave;n:</strong>&nbsp;Juventus:&nbsp;Cristiano Ronaldo&nbsp;2&#39;, 65&#39;. Sampdoria: Fabio Quagliarella 33&#39;.</p>\r\n\r\n<p><strong>Đội h&igrave;nh ra s&acirc;n</strong></p>\r\n\r\n<p><img alt=\"st - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/cats-1850.jpg\" width=\"896\" /></p>\r\n\r\n<p>Phụng Sồ | 18:30 29/12/2018</p>\r\n', 'YTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(35, 'hoduc17', , 'Ronaldo tiết lộ kỳ vọng nếu chạm trán Real Madrid', 'Trả lời tờ Record ở quê nhà Bồ Đào Nha, Cristiano Ronaldo cho biết anh vẫn còn rất nhiều tình cảm với CLB cũ Real Madrid.', '<p>Trả lời tờ Record ở qu&ecirc; nh&agrave; Bồ Đ&agrave;o Nha, Cristiano Ronaldo cho biết anh vẫn c&ograve;n rất nhiều t&igrave;nh cảm với CLB cũ Real Madrid.</p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/Cristiano+Ronaldo-search/\" target=\"_blank\">Cristiano Ronaldo</a>&nbsp;thừa nhận muốn những người h&acirc;m mộ&nbsp;Real Madrid&nbsp;đ&oacute;n ch&agrave;o trong trường hợp anh trở lại.<em>&nbsp;&quot;Santiago Bernabeu l&agrave; nh&agrave; của t&ocirc;i trong nhiều năm v&agrave; sẽ lu&ocirc;n lu&ocirc;n l&agrave; s&acirc;n vận động rất đặc biệt. T&ocirc;i lu&ocirc;n c&oacute; t&igrave;nh cảm với&nbsp;<a href=\"http://www.bongda.com.vn/Real+Madrid-search/\" target=\"_blank\">Real Madrid</a>&nbsp;cũng như những người h&acirc;m mộ v&agrave;<strong>muốn m&igrave;nh sẽ được đ&oacute;n ch&agrave;o nếu trở lại</strong>&quot;.</em></p>\r\n\r\n<p>Ronaldo cũng tiết lộ khoảnh khắc được trở lại Old Trafford đối đầu với Man United l&agrave; &quot;trải nghiệm đặc biệt&quot; với bản th&acirc;n.&nbsp;<em>&quot;Manchester ư? Đ&oacute; l&agrave; ng&agrave;y trở lại tuyệt vời. Những CĐV MU lu&ocirc;n đ&oacute;n ch&agrave;o t&ocirc;i như khi t&ocirc;i c&ograve;n thi đấu tại Old Trafford vậy&quot;</em>, Ronaldo n&oacute;i.</p>\r\n\r\n<p><img alt=\" - Bóng Đá\" src=\"http://media.bongda.com.vn/files/bao.nguyen/2019/01/03/ronaldo-1021.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;Ronaldo đ&atilde; c&ugrave;ng Real Madrid gi&agrave;nh 4 chức v&ocirc; địch Champions League. Ảnh:&nbsp;Getty Images.</h2>\r\n\r\n<p>Ronaldo đ&atilde; rời Real Madrid v&agrave;o m&ugrave;a h&egrave; 2018 với gi&aacute; 100 triệu euro để chuyển tới Juventus. Trong m&agrave;u &aacute;o mới, Ronaldo ngay lập tức tỏa s&aacute;ng với 15 b&agrave;n tr&ecirc;n mọi mặt trận để trở th&agrave;nh ch&acirc;n s&uacute;t ghi nhiều b&agrave;n thứ 2 cho Juve trong năm 2018, chỉ sau Paulo Dybala.</p>\r\n\r\n<p>Tại Serie A chỉ sau 4 th&aacute;ng, Ronaldo c&oacute; 14 b&agrave;n sau 19 trận v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/thoi-dinh-cao-ro-beo-cung-khong-khoi-dau-tot-bang-ronaldo-o-serie-a-d479332.html\" target=\"_blank\">trở th&agrave;nh &quot;t&acirc;n binh&quot; hay bậc nhất trong lịch sử giải đấu cao nhất Italy</a>, vượt qua cả những t&ecirc;n tuổi như &quot;Người ngo&agrave;i h&agrave;nh tinh&quot; Ronaldo, Andriy Shevchenko hay Diego Maradona.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:08</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:02</p>\r\n\r\n<p>Trong khi đ&oacute;, Real Madrid lao đao sau khi CR7 rời đi khi thua Barcelona 1-5 trong trận El Clasico lượt đi v&agrave; phải sa thải HLV Julen Lopetegui. Hiện Real chỉ đứng thứ 4 tr&ecirc;n bảng xếp hạng La Liga, k&eacute;m Barca 4 điểm. Năm 2018, Ronaldo vẫn l&agrave; ch&acirc;n s&uacute;t số một của Real với 28 b&agrave;n d&ugrave; anh đ&atilde; rời đi từ th&aacute;ng 7.</p>\r\n\r\n<p>Ronaldo trong m&agrave;u &aacute;o mới Juventus đ&atilde; trở lại Old Trafford đối đầu MU tại v&ograve;ng bảng Champions League m&ugrave;a n&agrave;y. CR7 kh&ocirc;ng ghi b&agrave;n nhưng chơi ấn tượng v&agrave; đ&oacute;ng g&oacute;p quan trọng v&agrave;o b&agrave;n thắng duy nhất của trận đấu do c&ocirc;ng của Paulo Dybala.</p>\r\n', 'YTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(36, 'ducdeptrai', , 'Vào chung kết Coppa Italia, Gattuso khen Montella nức nở', 'Sau khi đánh bại Lazio tại bán kết lượt về Coppa Italia, HLV Gennaro Gattuso đã gửi lời cám ơn đến HLV cũ của AC Milan, Vincenzo Montella.', '<p><a href=\"http://www.bongda.com.vn/AC+Milan-search/\" target=\"_blank\">AC Milan</a>&nbsp;tiếp tục cho thấy sức mạnh của họ dưới thời của HLV&nbsp;<a href=\"http://www.bongda.com.vn/Gennaro+Gattuso-search/\" target=\"_blank\">Gennaro Gattuso</a>&nbsp;bằng chiến thắng tại b&aacute;n kết Coppa Italia trước Lazio. Qua đ&oacute; họ gi&agrave;nh v&eacute; v&agrave;o chơi chung kết với Juventus. Ph&aacute;t biểu sau trận đấu, ng&agrave;i Rino vẫn tỏ ra kh&aacute; khiếm tốn v&agrave; d&agrave;nh lời cảm ơn đến HLV cũ l&agrave;&nbsp;Vincenzo Montella.</p>\r\n\r\n<p><img alt=\"Vào chung kết Coppa Italia, Gattuso khen Montella nức nở - Bóng Đá\" src=\"http://media.bongda.com.vn/files/trang.nguyen/2018/03/01/000822534-e27fdd17-38f4-452e-8153-f3fb504ecfc0-0850.jpg\" width=\"810\" /></p>\r\n\r\n<h2>&nbsp;Gattuso tỏ ra khiếm tốn.</h2>\r\n\r\n<p>Rino ph&aacute;t biểu: &quot;<em>Lazio l&agrave; một đội b&oacute;ng rất mạnh. Ch&uacute;ng t&ocirc;i đ&atilde; c&oacute; một trận cầu căng thẳng nhưng cũng c&oacute; những sai lầm trong việc tạo ra qu&aacute; nhiều khoảng trống cho Immobile. Lẽ ra Milan đ&atilde; c&oacute; b&agrave;n thắng trong thời gian thi đấu ch&iacute;nh thức.</em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/buffon-toa-sang-juve-chiem-loi-the-lon-tai-coppa-italia-d433220.html\">Buffon tỏa s&aacute;ng, Juve chiếm lợi thế lớn tại Coppa Italia</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/allegri-toi-khong-muon-noi-them-gi-nua-d429511.html\">Allegri: &quot;T&ocirc;i kh&ocirc;ng muốn n&oacute;i th&ecirc;m g&igrave; nữa!&quot;</a></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p><em>Sở dĩ tập thể c&oacute; được ng&agrave;y h&ocirc;m nay l&agrave; nhờ c&aacute;c cầu thủ đ&atilde; cố gắng v&agrave; một phần c&ocirc;ng lao to lớn của&nbsp;Montella. &Ocirc;ng ấy đ&atilde; c&oacute; c&ocirc;ng gắn kết c&aacute;c cầu thủ lại với nhau từ trước đ&oacute;.&quot;</em></p>\r\n\r\n<p>Sau khi c&aacute;m ơn HLV cũ, Gattuso thể hiện quyết t&acirc;m của m&igrave;nh với AC Milan. &quot;<em>Ch&uacute;ng t&ocirc;i sẽ c&ograve;n những trận đấu quan trọng ph&iacute;a trước v&agrave; ch&uacute;ng t&ocirc;i sẽ tiếp tục l&agrave;m tốt cho đến th&aacute;ng 6. T&ocirc;i tin m&igrave;nh kh&ocirc;ng phải l&agrave; HLV sẽ ở cạnh Milan cho đến cuối c&ugrave;ng, nhưng&nbsp;<strong>cho đến hiện nay t&ocirc;i l&agrave; một người đ&atilde; rất may mắn rồi</strong>.&quot;</em></p>\r\n\r\n<p>Tại trận b&aacute;n kết lượt về tại khu&ocirc;n khổ Coppa Italia, sau khi chẳng thể ghi được b&agrave;n thắng n&agrave;o trong 120 ph&uacute;t tranh t&agrave;i, AC Milan v&agrave; Lazio đ&atilde; phải nhờ đến loạt s&uacute;t lu&acirc;n lưu để ph&acirc;n định thắng thua.&nbsp;Alessio Romagnoli l&agrave; người thực hiện t&igrave;nh huống s&uacute;t phạt quyết định để mang về chiến thắng 5-4 đầy nghẹt thở d&agrave;nh cho AC Milan.</p>\r\n\r\n<p><strong>Đối thủ của Rossoneri trong trận đấu cuối c&ugrave;ng sẽ l&agrave; Juventus</strong>, đội b&oacute;ng đ&atilde; vượt qua Atalanta với tổng tỷ số 2-0.</p>\r\n\r\n<p>Trang &Yacute; - BongDa.com.vn - TTVN | 08:55 01/03/2018</p>\r\n', 'PhapYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(37, 'ducdeptrai', , 'Ronaldo nói lời thẳng thắn về VAR sau khi lập cú đúp cho Juventus', 'Tiền đạo Cristiano Ronaldo lên tiếng sau chiến thắng của Juventus trước Sampdoria.', '<p>Vừa qua,&nbsp;<a href=\"http://www.bongda.com.vn/Juventus-search/\" target=\"_blank\">Juventus</a>&nbsp;đ&atilde; ch&iacute;nh thức kh&eacute;p lại giai đoạn lượt đi Serie A một c&aacute;ch ho&agrave;n hảo với chiến thắng 2-1 trước Sampdoria. Ng&ocirc;i sao s&aacute;ng nhất như thường lệ vẫn l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Cristiano+Ronaldo-search/\" target=\"_blank\">Cristiano Ronaldo</a>&nbsp;với một c&uacute; penalty th&agrave;nh c&ocirc;ng c&ugrave;ng một pha ra ch&acirc;n thần sầu ở ngay ph&uacute;t thứ hai của trận đấu. Với c&uacute; đ&uacute;p n&agrave;y, số 7 đ&atilde; vượt qua Rui Barros để trở th&agrave;nh cầu thủ người Bồ Đ&agrave;o Nha ghi&nbsp;<a href=\"http://www.bongda.com.vn/ha-sat-sampdoria-ronaldo-lai-them-mot-lan-di-vao-lich-su-d479111.html\" target=\"_blank\">nhiều b&agrave;n thắng nhất</a>&nbsp;tại Serie A trong một m&ugrave;a giải.</p>\r\n\r\n<p>Thế nhưng c&ograve;n một điểm nhấn kh&aacute;c đ&aacute;ng ch&uacute; &yacute; kh&ocirc;ng k&eacute;m, đ&oacute; l&agrave; việc tiền vệ&nbsp;Riccardo Saponara b&ecirc;n ph&iacute;a c&aacute;c vị kh&aacute;ch cũng su&yacute;t ch&uacute;t nữa c&oacute; thể điền t&ecirc;n l&ecirc;n bảng tỉ số nếu kh&ocirc;ng c&oacute; sự xuất hiện của c&ocirc;ng nghệ VAR. N&oacute;i về điều n&agrave;y, Cristiano chia sẻ:</p>\r\n\r\n<p><img alt=\"Ronaldo comments on VAR after controversial Juve win vs. Samp - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tu.dao/2018/12/29/dc-cover-tsphaeasihnii622qdm3ognt46-20181109124905medi-2253.jpeg\" width=\"1000\" /></p>\r\n\r\n<h2>Ronaldo l&agrave; cầu thủ hay nhất trận đấu giữa Juventus v&agrave; Sampdoria.</h2>\r\n\r\n<p><em>&quot;Ch&uacute;ng t&ocirc;i đ&atilde; l&agrave;m rất tốt, kh&ocirc;ng chỉ trong trận đấu n&agrave;y m&agrave; l&agrave; từ đầu m&ugrave;a giải tới giờ. Gần như mọi trận đấu đều kết th&uacute;c với một thắng lợi cho Juventus. Thế nhưng m&ugrave;a giải c&ograve;n rất d&agrave;i, v&igrave; thế ch&uacute;ng t&ocirc;i vẫn cần tiếp tục duy tr&igrave; sự tập trung.&quot;</em></p>\r\n\r\n<p><em><strong>&quot;C&ograve;n VAR ư? T&ocirc;i th&iacute;ch c&ocirc;ng nghệ n&agrave;y bởi n&oacute; hạn chế việc c&aacute;c trọng t&agrave;i mắc sai lầm.</strong>&nbsp;Thế nhưng d&ugrave; thế n&agrave;o, c&ocirc;ng việc của c&aacute;c trọng t&agrave;i cũng l&agrave; rất kh&oacute; khăn v&agrave; ch&uacute;ng ta n&ecirc;n tạo điều kiện tốt nhất để họ l&agrave;m nhiệm vụ của m&igrave;nh.&quot;</em></p>\r\n', 'DucYTBNC1CN', 1);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(38, 'ducdeptrai', , 'Ronaldo bùng nổ lập cú đúp, Juventus khép lại nửa đầu mùa giải hoàn hảo', 'Với điểm tựa Allianz, Bianconeri chính thức đóng lại giai đoạn lượt đi bằng thành tích bất bại.', '', 'YTBNC1CN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(39, 'hoduc17', , 'Man Utd có động thái cụ thể vì tiền đạo 40 triệu euro người Nhật Bản', 'Rất nhiều đội bóng Anh đang để mắt đến tiền đạo người Nhật Bản, Shoya Nakajima.', '<p>Shoya Nakajima năm nay 24 tuổi, đang thi đấu cho CLB Portimonense ở Bồ Đ&agrave;o Nha. Nakajima c&oacute; vị tr&iacute; sở trường l&agrave; tiền đạo tr&aacute;i, nhưng khi cần, anh c&oacute; thể chơi tốt ở c&aacute;nh phải. Ng&ocirc;i sao người Nhật Bản c&oacute; khả năng tạo đột biến tốt qua những đường chuyền, những pha đi b&oacute;ng v&agrave;o trung lộ hay dứt điểm từ xa lợi hại.</p>\r\n\r\n<p><img alt=\"Man Utd theo dõi Nakajima  - Bóng Đá\" src=\"http://media.bongda.com.vn/files/thach.pham/2019/01/04/shoyanakajima-1-0609.jpg\" width=\"700\" /></p>\r\n\r\n<h2>&nbsp;Shoya Nakajima được Man Utd quan t&acirc;m.</h2>\r\n\r\n<p>Sau 13 trận ở giải VĐQG Bồ Đ&agrave;o Nha, Nakajima đ&atilde; ghi được 5 b&agrave;n thắng, cung cấp 5 đường kiến tạo v&agrave; c&oacute; đến 3 lần được b&igrave;nh chọn l&agrave; Cầu thủ xuất sắc nhất trận. Trang WhoScored chấm điểm trung b&igrave;nh của Nakajima l&ecirc;n đến 7.25.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hiện tại, Nakajima đang lọt v&agrave;o tầm ngắm của nhiều đội b&oacute;ng lớn ở Anh, như Wolves, Leicester City, Chelsea. Mới nhất, Man Utd đ&atilde; ph&aacute;i c&aacute;c tuyển trạch vi&ecirc;n của m&igrave;nh trực tiếp &#39;xem gi&ograve;&#39; Nakajima trong trận đấu của Portimonense với Benfica h&ocirc;m thứ Tư.</p>\r\n\r\n<p>Nakajima c&oacute; điều khoản giải ph&oacute;ng hợp đồng với Portimonense l&ecirc;n đến 40 triệu euro. Bởi vậy, sẽ kh&ocirc;ng dễ để c&aacute;c đội b&oacute;ng Anh đưa cầu thủ tấn c&ocirc;ng người Nhật Bản về xứ Sương m&ugrave;.</p>\r\n\r\n<p><strong>T&agrave;i năng đặc biệt của Shoya Nakajima:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Minh Tuấn | 05:14 04/01/2019</p>\r\n', 'AnhYCN', 0),
(40, 'hoduc17', , 'Messi chỉ ra 5 cái tên Barcelona nên mua', 'Theo Don Balon, Lionel Messi đã đề xuất với Barcelona 5 cái tên anh tin rằng cần được quan tâm trên TTCN lần này.', '<p>Cụ thể 5 c&aacute;i t&ecirc;n được Messi đề cập đến đ&oacute; l&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/Adrien+Rabiot-search/\" target=\"_blank\">Adrien Rabiot</a>,&nbsp;<a href=\"http://www.bongda.com.vn/Matthijs+De+Ligt-search/\" target=\"_blank\">Matthijs de Ligt</a>, Benjamin Pavard,&nbsp;<a href=\"http://www.bongda.com.vn/Frenkie+de+Jong-search/\" target=\"_blank\">Frenkie De Jong</a>&nbsp;v&agrave; Krzysztof Piątek.</p>\r\n\r\n<p><img alt=\"Messi chỉ ra 5 cái tên Barcelona nên mua - Bóng Đá\" src=\"http://media.bongda.com.vn/files/anh.vu/2019/01/03/3a1-2115.jpg\" width=\"594\" /></p>\r\n\r\n<h2>&nbsp;Messi đ&atilde; đề xuất cho Barcelona 5 c&aacute;i t&ecirc;n n&ecirc;n mua.</h2>\r\n\r\n<p>Trong số n&agrave;y, Frenkie De Jong l&agrave; cầu thủ đ&atilde; được truyền th&ocirc;ng nhắc đến kh&aacute; nhiều trong thời gian qua như một ng&ocirc;i sao c&oacute; khả năng cập bến Barcelona trong tương lai l&agrave; rất cao. Bản th&acirc;n gia đ&igrave;nh của De Jong cũng đ&atilde; c&oacute; những ph&aacute;t biểu định hướng tiền vệ 21 tuổi n&agrave;y đến với s&acirc;n Nou Camp thi đấu.</p>\r\n\r\n<p>Người đồng đội của De Jong tại Ajax l&agrave; Matthijs de Ligt cũng l&agrave; một trung vệ đ&atilde; được Barcelona theo đuổi rất l&acirc;u. Tuy nhi&ecirc;n cậu b&eacute; v&agrave;ng 2018 v&agrave;o thời điểm n&agrave;y vẫn đang rất lưỡng lự về tương lai, khi anh đang nhận được những lời mời gọi hấp dẫn kh&ocirc;ng k&eacute;m từ Anh v&agrave; Italia.</p>\r\n\r\n<p>Trong khi đ&oacute; Adrien Rabiot l&agrave; cầu thủ m&agrave; Barcelona dễ d&agrave;ng tiếp cận nhất, khi hợp đồng giữa anh v&agrave; PSG sẽ hết hạn v&agrave;o cuối m&ugrave;a giải năm nay, trong khi cả 2 b&ecirc;n dường như kh&ocirc;ng hề c&oacute; &yacute; định ngồi lại đ&agrave;m ph&aacute;n trong thời gian tới.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:04</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:00</p>\r\n\r\n<p>Krzysztof Piątek l&agrave; một hiện tượng đang nổi l&ecirc;n tại Serie A v&agrave; đ&acirc;y sẽ l&agrave; một sự bổ sung kh&ocirc;ng tồi cho h&agrave;ng c&ocirc;ng. C&ograve;n Benjamin Pavard l&agrave; c&aacute;i t&ecirc;n duy nhất trong 5 người kể tr&ecirc;n chưa từng được truyền th&ocirc;ng nhắc tới như mục ti&ecirc;u của Barcelona.</p>\r\n\r\n<p><em><strong>Video t&agrave;i năng của Frenkie De Jong</strong></em></p>\r\n', 'YTBNCN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(41, 'dung29', , 'Sao Chelsea đạt thỏa thuận với Monaco, sự thật sốc liên quan đến Pogba, MU và Barca', 'Cesc Fabregas đã liên hệ xong và sắp gia nhập Monaco.', '<p>Phi&ecirc;n chợ Đ&ocirc;ng đang diễn ra v&ocirc; c&ugrave;ng n&aacute;o nhiệt nhưng cũng rất căng thẳng. C&aacute;c CLB đều l&ecirc;n sẵn kế hoạch v&agrave; tranh đua quyết liệt để ho&agrave;n tất c&aacute;c bản hợp đồng chất lượng. Kh&oacute; để bom tấn đ&igrave;nh đ&aacute;m được k&iacute;ch nổ, song hứa hẹn sẽ c&oacute; nhiều thương vụ đắt gi&aacute;.</p>\r\n\r\n<p><img alt=\"Sao Chelsea đạt thỏa thuận với Monaco,  - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/cescfabregas1409abc-1534.jpg\" width=\"968\" /></p>\r\n\r\n<h2>Cesc sắp rời Chelsea.</h2>\r\n\r\n<p>Vừa qua,&nbsp;<a href=\"http://www.bongda.com.vn/soc-sarri-thua-nhan-chang-biet-gi-ve-viec-chelsea-mua-pulisic-d479647.html\" target=\"_blank\">Chelsea vừa ch&iacute;nh thức chi&ecirc;u mộ th&agrave;nh c&ocirc;ng cầu thủ chạy c&aacute;nh Christian Pulisic&nbsp;</a>với gi&aacute; cao ngất ngưỡng, 64 triệu euro. V&agrave;&nbsp;TTCN một phen nh&aacute;o nh&agrave;o v&igrave; kh&ocirc;ng &iacute;t cổ động vi&ecirc;n bất ngờ. Thế nhưng, chưa dừng lại ở đ&oacute; khi song song The Blues sắp chia tay ng&ocirc;i sao&nbsp;Cesc Fabregas.</p>\r\n\r\n<p>Thời gian qua, b&aacute;o ch&iacute; quốc tế đăng tải kh&ocirc;ng &iacute;t th&ocirc;ng tin li&ecirc;n quan đến việc tuyển thủ người T&acirc;y Ban Nha rời Stamford Bridge v&agrave; CLB anh cập bến l&agrave; AS Monaco. Mới đ&acirc;y, tờ L&#39;Equipe tiếp tục cập nhật về thương vụ tr&ecirc;n. Theo đ&oacute;, ph&iacute;a đội b&oacute;ng nước Ph&aacute;p đ&atilde; li&ecirc;n lạc xong với tiền vệ 31 tuổi. Kh&ocirc;ng những vậy,&nbsp;<strong>đại diện Ligue 1 v&agrave; Cesc cũng đ&atilde; đạt thỏa thuận sơ bộ.&nbsp;</strong></p>\r\n\r\n<p>Hiện tại, ng&ocirc;i sao xứ b&ograve; t&oacute;t vẫn c&ograve;n hợp đồng 6 th&aacute;ng với&nbsp;<a href=\"http://www.bongda.com.vn/chelsea-search/\" target=\"_blank\">Chelsea</a>. Dẫu vậy, Ban l&atilde;nh đạo Monaco vẫn muốn chuẩn bị cam kết mới cho tuyển thủ số 4. Fabregas sẽ gắn b&oacute; với s&acirc;n&nbsp;Louis II trong v&ograve;ng 2 năm rưỡi v&agrave; tiền lương khoảng 10 triệu euro/năm. Ở đ&acirc;y, tiền vệ 31 tuổi sẽ c&oacute; cơ hội l&agrave; việc với người đ&agrave;n anh cũng l&agrave; đồng đội cũ, HLV&nbsp;Thierry Henry.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>00:07</p>\r\n\r\n<p>/</p>\r\n\r\n<p>00:15</p>\r\n\r\n<p>00:00</p>\r\n\r\n<p><img alt=\"Sao Chelsea đạt thỏa thuận với Monaco,  - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/skysports-paul-pogba-manchester-united_4533670-1534.jpg\" width=\"768\" /></p>\r\n\r\n<h2>Pogba l&agrave; con cưng của MU.</h2>\r\n\r\n<p>Cũng tr&ecirc;n đất Ph&aacute;p, ở Paris, tương lai Rabiot vẫn chưa được quyết định. Trước đ&oacute;, theo Sport.es,&nbsp;trong tuần n&agrave;y, ng&ocirc;i sao 23 tuổi sẽ k&yacute; hợp đồng với Barcelona. Tuyển thủ người Ph&aacute;p sẽ gia nhập đội chủ s&acirc;n Camp Nou bằng một bản hợp đồng k&eacute;o d&agrave;i 5 năm với mức lương v&agrave;o khoảng 10 triệu euro/m&ugrave;a. Song, hiện tại, tờ Mundo Deportivo cho hay, mẹ tuyển thủ số 25 chưa lựa chọn xong bến đỗ v&agrave; anh tiếp tục li&ecirc;n hệ với nhiều CLB kh&aacute;c nhau.</p>\r\n\r\n<p>Ở một diễn biến kh&aacute;c, truyền th&ocirc;ng T&acirc;y Ban Nha vừa tiết lộ sự thật kh&ocirc;ng nhỏ li&ecirc;n quan đến thương vụ Pogba, Barca v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/manchester+united-search/\" target=\"_blank\">Manchester United</a>. Cụ thể, theo Mundo Deportivo, l&yacute; do khiến đại diện Catalan thất bại trong việc chi&ecirc;u mộ si&ecirc;u sao người Ph&aacute;p kh&ocirc;ng nằm ở tiền bạc.</p>\r\n\r\n<p>Thời điểm đ&oacute;, bom tấn 25 tuổi thật sự ch&aacute;n cảnh ở Old Trafford v&igrave; Mourinho. Anh đ&atilde; nhờ người đại diện t&igrave;m đến đương kim v&ocirc; địch La Liga. Sau đ&oacute;, Ban l&atilde;nh đạo Barca đ&atilde; li&ecirc;n hệ với thượng tầng MU v&agrave; nhận được c&acirc;u trả lời từ CEO&nbsp;Ed Woodward. Theo đ&oacute;,<strong>&nbsp;&ocirc;ng cho biết Pogba l&agrave; &#39;&#39;con cưng&#39;&#39; chủ đội nh&agrave;, gia đ&igrave;nh&nbsp;Glazer.</strong>&nbsp;Messi quan trọng với g&atilde; khổng lồ thế n&agrave;o th&igrave; tuyển thủ số 6 quan trọng với &quot;Quỷ đỏ&quot; như thế đ&oacute;. V&agrave; tức nhi&ecirc;n, họ sẽ kh&ocirc;ng bao giờ để anh ra đi.&nbsp;</p>\r\n\r\n<p>Bạch Băng | 15:34 03/01/2019</p>\r\n', 'YTBNC1CN', 0),
(42, 'duccong', , 'Lukaku bị chỉ trích không hết lòng vì Man Utd', 'Cựu tiền đạo tuyển Anh, Danny Murphy đã lên tiếng chỉ trích Romelu Lukaku khi tiền đạo chủ lực của Man Utd từ chối ra sân từ đầu trong trận chung kết FA Cup với Chelsea.', '<p>Lukaku d&iacute;nh chấn thương mắt c&aacute; nh&acirc;n trong trận đấu với Arsenal cuối th&aacute;ng Tư. Từ đ&oacute; đến trước trận chung kết&nbsp;<a href=\"http://www.bongda.com.vn/cup-fa/\" target=\"_blank\">FA Cup</a>, tiền đạo người Bỉ kh&ocirc;ng ra s&acirc;n một ph&uacute;t n&agrave;o. V&agrave; đến trận chung kết, Lukaku chỉ v&agrave;o s&acirc;n từ ghế dự bị.</p>\r\n\r\n<p>Kh&ocirc;ng Lukaku, Man Utd thi đấu rất bế tắc với Marcus Rashford tr&ecirc;n h&agrave;ng c&ocirc;ng. Việc thiếu đi ch&acirc;n s&uacute;t chủ lực của đội b&oacute;ng l&agrave; một trong những l&iacute; do khiến Quỷ đỏ phải ngậm ng&ugrave;i nh&igrave;n Chelsea n&acirc;ng cao c&uacute;p v&ocirc; địch.</p>\r\n\r\n<p><img alt=\"Lukaku bị chỉ trích không hết lòng vì Man Utd - Bóng Đá\" src=\"http://media.bongda.com.vn/files/thach.pham/2018/05/22/c262896afe1e4bf08e82ab8992b0a1f3ashx-1715.jpg\" width=\"1024\" /></p>\r\n\r\n<h2>&nbsp;Lukaku bị chỉ tr&iacute;ch khi từ chối đ&aacute; ch&iacute;nh trước Chelsea.</h2>\r\n\r\n<p>Sau trận đấu, HLV Jose Mourinho thừa nhận&nbsp;<a href=\"http://www.bongda.com.vn/thua-chung-ket-fa-cup-mourinho-to-lukaku-va-fellaini-choi-khong-het-suc-d446336.html\" target=\"_blank\">Lukaku đ&atilde; y&ecirc;u cầu kh&ocirc;ng ra s&acirc;n đ&aacute; ch&iacute;nh v&igrave; l&iacute; do thể lực</a>. V&agrave; Danny Murphy đ&atilde; l&ecirc;n tiếng chỉ tr&iacute;ch ng&ocirc;i sao tuyển Bỉ:&nbsp;<em>&quot;T&ocirc;i đ&atilde; gặp đủ loại chấn thương. V&agrave; t&ocirc;i chưa bao giờ từ chối ra s&acirc;n cả, trừ khi thể lực của t&ocirc;i kh&ocirc;ng cho ph&eacute;p.</em></p>\r\n\r\n<ul>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/thua-chung-ket-fa-cup-mourinho-to-lukaku-va-fellaini-choi-khong-het-suc-d446336.html\">Thua chung kết FA Cup, Mourinho tố Lukaku v&agrave; Fellaini chơi kh&ocirc;ng hết sức</a></h3>\r\n	</li>\r\n	<li>\r\n	<h3><a href=\"http://www.bongda.com.vn/mourinho-noi-gi-khi-de-lukaku-ngoi-du-bi-va-trang-tay-d446157.html\">Mourinho n&oacute;i g&igrave; khi để Lukaku ngồi dự bị v&agrave; trắng tay?</a></h3>\r\n	</li>\r\n</ul>\r\n\r\n<p><em>C&oacute; một v&agrave;i cầu thủ lại kh&ocirc;ng muốn ra s&acirc;n d&ugrave; đạt 100% thể lực. Nếu đ&acirc;y l&agrave; sự thật th&igrave;&nbsp;<strong>người h&acirc;m mộ Man Utd phải ph&aacute;t đi&ecirc;n l&ecirc;n mất.</strong>&nbsp;Nếu Romelu Lukaku cảm thấy m&igrave;nh sẽ phải đối mặt với điều g&igrave; đ&oacute; tồi tệ, th&igrave; tốt nhất cậu ấy đừng ngồi l&ecirc;n ghế dự bị l&agrave;m g&igrave;.&quot;</em></p>\r\n\r\n<p>M&ugrave;a n&agrave;y, Lukaku đ&atilde; c&oacute; 27 b&agrave;n thắng cho Man Utd. Anh sẽ c&ugrave;ng ĐTQG Bỉ chinh phục World Cup 2018 từ ng&agrave;y 14/6. Nhiều người cho rằng đ&acirc;y l&agrave; l&iacute; do khiến Lukaku muốn dưỡng sức nhằm tr&aacute;nh những rủi ro để c&oacute; sự chuẩn bị tốt nhất cho ng&agrave;y hội b&oacute;ng đ&aacute; lớn nhất h&agrave;nh tinh.</p>\r\n\r\n<p><strong>Tầm quan trọng của Lukaku với Man Utd:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Minh Tuấn | 16:27 22/05/2018</p>\r\n', 'PhapYTBNC1CN', 0);
INSERT INTO `post` (`idaccount`, `nickname`, `image`, `header`, `title`, `content`, `type`, `duyet`) VALUES
(43, 'lelan7', , 'Xong! AC Milan chính thức làm rõ khả năng Wenger thay Gattuso', 'Giám đốc thể thao Leonardo cuối cùng đã lên tiếng về biến động trên băng ghế chỉ đạo Rossoneri.', '<p>Th&aacute;ng 12 đ&atilde; trải qua kh&ocirc;ng thể tồi tệ hơn với AC Milan. 4 trận đấu Serie A gần nhất,&nbsp;<a href=\"http://www.bongda.com.vn/ac+milan-search/\" target=\"_blank\">Rossoneri</a>&nbsp;kh&ocirc;ng ghi được bất kỳ b&agrave;n thắng n&agrave;o v&agrave; rơi xuống vị tr&iacute; thứ 6 tr&ecirc;n BXH. Kh&ocirc;ng những thế, thất bại 1-3 trước&nbsp;Olympiakos Piraeus c&ograve;n khiến đội chủ s&acirc;n San Siro phải sớm dừng bước ở Europa League ngay từ v&ograve;ng bảng.&nbsp;</p>\r\n\r\n<p>Phong độ thảm hại tr&ecirc;n khiến chiếc ghế của&nbsp;Gennaro Gattuso lung lay dữ dội.&nbsp;<a href=\"http://www.bongda.com.vn/sau-tat-ca-cdv-arsenal-van-rat-nang-long-voi-wenger-d477986.html\" target=\"_blank\">Cựu thuyền trưởng Arsenal, Arsene Wenger</a>&nbsp;l&agrave; c&aacute;i t&ecirc;n được đồn đo&aacute;n sẽ sớm thay thế vị tr&iacute; của Gattuso tại AC Milan. Tuy nhi&ecirc;n, trong diễn biến mới nhất, Rossoneri đ&atilde; b&aacute;c bỏ th&ocirc;ng tin n&agrave;y.</p>\r\n\r\n<p><img alt=\"AC Milan làm rõ khả năng Wenger thay Gattuso - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/29/214238378-bf994080-824c-44d0-b145-92161124366b-0826.jpg\" width=\"560\" /></p>\r\n\r\n<h2>&nbsp;Gattuso sẽ kh&ocirc;ng bị thay thế bởi Wenger.</h2>\r\n\r\n<p>Ph&aacute;t biểu với ESPN, Gi&aacute;m đốc thể thao&nbsp;Leonardo Araujo khẳng định AC Milan vẫn đặt niềm tin lớn ở HLV đương nhiệm.&nbsp;<em>&quot;<strong>Gattuso l&agrave; HLV của ch&uacute;ng t&ocirc;i v&agrave; chưa từng c&oacute; bất kỳ kế hoạch thay thế n&agrave;o.</strong>&quot;</em>&nbsp;Cựu danh thủ Brazil quả quyết.&nbsp;<em>&quot;Ch&uacute;ng t&ocirc;i chưa từng li&ecirc;n lạc với HLV n&agrave;o m&agrave; b&aacute;o ch&iacute; đồn thổi thời gian qua. AC Milan vẫn đang tr&ecirc;n đường nhắm đến mục ti&ecirc;u của m&igrave;nh, m&agrave; cụ thể l&agrave; vị tr&iacute; thứ 4 Serie A.&quot;</em></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Trước đ&oacute;&nbsp;<a href=\"http://www.bongda.com.vn/gennaro+gattuso%20-search/\" target=\"_blank\">Gattuso</a>&nbsp;cũng từng ph&aacute;t biểu tự tin &ocirc;ng thường xuy&ecirc;n trao đổi với gi&aacute;m đốc&nbsp;Paolo Maldini c&ugrave;ng Leonardo h&agrave;ng ng&agrave;y v&agrave; được bảo đảm chắc chắn về tương lai.</p>\r\n\r\n<p>Phụng Sồ | 07:10 29/12/2018</p>\r\n', 'YTBNC1CN', 0);
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(1, 'hoduc17', , 'Xong! PSG chính thức ra thông báo về việc bán Neymar và Mbappe', 'Gã nhà giàu nước Pháp lên tiếng về thông tin sắp để 2 siêu sao lớn ra đi.', '<p>H&ocirc;m qua, ấn phẩm nổi tiếng nước Ph&aacute;p, L&#39;Equipe đ&atilde; đưa ra th&ocirc;ng tin chấn động rằng&nbsp;Paris Saint-Germain c&oacute; thể phải b&aacute;n 1 trong 2 si&ecirc;u sao Neymar hoặc Kylian Mbappe. Tờ b&aacute;o n&agrave;y cho rằng&nbsp;<a href=\"http://www.bongda.com.vn/duoc-moi-goi-sang-premier-league-day-la-cau-tra-loi-cua-neymar-d475888.html\" target=\"_blank\">đương kim v&ocirc; địch Ligue 1 buộc c&acirc;n nhắc c&aacute;c giải ph&aacute;p</a>, để c&oacute; thể đảm bảo Luật C&ocirc;ng bằng t&agrave;i ch&iacute;nh FFP của UEFA.</p>\r\n\r\n<p>Tin tức tr&ecirc;n g&acirc;y x&ocirc;n xao dư luận v&agrave;&nbsp;<a href=\"http://www.bongda.com.vn/paris+saint+germain-search/\" target=\"_blank\">PSG</a>&nbsp;kh&ocirc;ng c&ograve;n c&aacute;ch n&agrave;o kh&aacute;c ngo&agrave;i l&ecirc;n tiếng. Trong th&ocirc;ng b&aacute;o được đưa ra ngay sau đ&oacute;, BLĐ đội chủ s&acirc;n Parc des Princes đ&atilde; phản b&aacute;c ho&agrave;n to&agrave;n v&agrave; chỉ tr&iacute;ch nội dung b&agrave;i viết&nbsp;L&#39;Equipe đăng tải.</p>\r\n\r\n<p><img alt=\"PSG phủ nhận việc bán Neymar và Mbappe - Bóng Đá\" src=\"http://media.bongda.com.vn/files/nam.tan/2018/12/08/psg-lao-dao-vi-uefa-lai-so-gay-se-phai-ban-neymar-mbappe-cho-real-lopetegui-kembali-bantah-kaitan-real-madrid-dengan-1537851592-125-width660height495-1541.jpg\" width=\"660\" /></p>\r\n\r\n<h2>&nbsp;PSG kh&ocirc;ng c&oacute; &yacute; định b&aacute;n bộ đ&ocirc;i si&ecirc;u sao.</h2>\r\n\r\n<p><em>&quot;<strong>CLB phủ nhận tất cả những c&aacute;o buộc ho&agrave;n to&agrave;n sai lệch&nbsp;v&agrave; kỳ lạ</strong>, với mục đ&iacute;ch duy nhất để tạo ra bầu kh&ocirc;ng kh&iacute; &aacute;p lực lớn đ&egrave; l&ecirc;n đội b&oacute;ng.&quot;</em>Trang chủ PSG th&ocirc;ng b&aacute;o.&nbsp;<em>&quot;PSG th&ecirc;m một lần ho&agrave;i nghi t&iacute;nh ch&acirc;n thực của&nbsp;L&#39;Equipe v&agrave; động cơ đằng sau h&agrave;nh động của họ.&quot;</em></p>\r\n\r\n<p><a href=\"http://www.bongda.com.vn/neymar-search/\" target=\"_blank\">Neymar</a>&nbsp;gia nhập đại diện thủ đ&ocirc; nước Ph&aacute;p trong thương vụ kỷ lục chuyển nhượng thế giới trị gi&aacute; 200 triệu bảng từ Barcelona năm ngo&aacute;i. Trong khi đ&oacute;, Mbappe cũng trở th&agrave;nh cầu thủ đắt gi&aacute; thứ hai mọi thời đại, sau khi PSG chấp nhận chi 166 triệu bảng để sở hữu anh từ AS Monaco.</p>\r\n', 'Phap');
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(4, 'lelan7', , 'Nóng! Arsenal chuẩn bị \"cuỗm\" đồng đội Messi, giá 40 triệu bảng\r\n', 'Đội chủ sân Emirates đang chuẩn bị kế hoạch chiêu mộ cầu thủ chạy cánh Cristian Pavon, người đang khoác áo CLB Boca Juniors, theo The Sun', '<p>Arsenal đang rất n&oacute;ng l&ograve;ng đưa về một tiền đạo v&agrave;o th&aacute;ng Gi&ecirc;ng v&agrave;&nbsp;<strong>họ được cho l&agrave; đ&atilde; mở c&aacute;c cuộc đ&agrave;m ph&aacute;n với Boca Juniors - đội b&oacute;ng sở hữu ch&acirc;n s&uacute;t Cristian Pavon</strong>. Cầu thủ n&agrave;y đang gặp kh&oacute; khăn v&igrave; chấn thương nhưng Unai Emery rất y&ecirc;u th&iacute;ch phong c&aacute;ch của tuyển thủ Argentina.</p>\r\n\r\n<p>Tờ The Sun ở Anh tuy&ecirc;n bố rằng Boca đang mong đợi một lời đề nghị từ The Gunners khi họ muốn thương vụ n&agrave;y sẽ được quyết định với con số 40 triệu bảng. C&aacute;c đại diện của&nbsp;<a href=\"http://www.bongda.com.vn/Pavon-search/\" target=\"_blank\">Pavon</a>&nbsp;cũng li&ecirc;n lạc với một số CLB v&agrave; họ tin tưởng anh muốn chuyển đến Premier League.</p>\r\n\r\n<p><img alt=\"Nóng! Duyệt chi 40 triệu bảng, Arsenal chuẩn bị \" src=\"http://media.bongda.com.vn/files/toan.vu/2018/12/16/gettyimages-1045759054-1431.jpg\" width=\"644\" /></p>\r\n\r\n<h2>&nbsp;Pavon sẽ gia nhập Arsenal v&agrave;o th&aacute;ng Gi&ecirc;ng?.</h2>\r\n\r\n<p>Fulham l&agrave; một đại diện kh&aacute;c ở xứ sương m&ugrave; tiếp cận đồng đội của Lionel Messi tr&ecirc;n tuyển Argentina, nhưng họ buộc phải ch&agrave;o thua v&igrave; mức ph&iacute; chuyển nhượng vượt qu&aacute; tầm với, trong khi Boca kh&ocirc;ng c&oacute; &yacute; định hạ số tiền như dự định ban đầu.</p>\r\n\r\n<p>Tuy nhi&ecirc;n, đội b&oacute;ng vừa thất bại ở CK Copa America trước River Plate tin rằng 40 triệu bảng l&agrave; điều &quot;b&igrave;nh thường&quot; với một&nbsp;<a href=\"http://www.bongda.com.vn/Arsenal-search/\" target=\"_blank\">Arsenal</a>&nbsp;đang trong thời kỳ chuyển giao quyền lực. Họ thực tế phải nghĩ đến phương &aacute;n thay Danny Welbeck v&igrave; tiền đạo 28 tuổi đ&atilde; d&iacute;nh chấn thương nặng c&aacute;ch đ&acirc;y chưa l&acirc;u.</p>\r\n\r\n<p>Chưa kể, Aaron Ramsey cũng chắc chắn ra đi v&agrave;o cuối m&ugrave;a giải hoặc c&oacute; thể l&agrave; ngay th&aacute;ng sau nếu đội b&oacute;ng n&agrave;o đ&oacute; ngo&agrave;i bi&ecirc;n giới nước Anh bạo chi. Đ&oacute; l&agrave; l&yacute; do Pavon l&agrave; sự lựa chọn l&yacute; tưởng v&agrave;o thời điểm n&agrave;y v&igrave; 40 triệu bảng b&acirc;y giờ kh&ocirc;ng thấm th&aacute;p v&agrave;o đ&acirc;u nếu nh&igrave;n v&agrave;o sự lũng đoạn của TTCN.</p>\r\n', 'DucYCN');
INSERT INTO `postwt` (`idpostwt`, `nickname`, `imagewt`, `headerwt`, `titlewt`, `contentwt`, `typewt`) VALUES
(5, 'lelan7', , 'Gần giờ ra quân, dàn sao Liver nghiêm túc đến lạ', ' Liverpool tích cực tập luyện cho trận đại chiến với Man City.', '<p><img alt=\"Liver tập - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Rạng s&aacute;ng 3/1, Liverpool sẽ h&agrave;nh qu&acirc;n đến s&acirc;n Etihad đối đầu với Man City.</h2>\r\n\r\n<p><img alt=\"Liver tập - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt1-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Liverpool đang ra sức tập luyện cho trận đại chiến quyết định.</h2>\r\n\r\n<p><img alt=\"Liver tập - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt2-1039.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Tất cả đều ch&uacute; t&acirc;m tập luyện.</h2>\r\n\r\n<p><img alt=\"Liver tập - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt3-1040.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Chỉ cần gi&agrave;nh chiến thắng, The Kop c&oacute; quyền nghĩ về chức v&ocirc; địch cuối m&ugrave;a.</h2>\r\n\r\n<p><img alt=\"Liver tập - Bóng Đá\" src=\"http://media.bongda.com.vn/files/tran.ha/2019/01/03/tt4-1040.jpeg\" width=\"630\" /></p>\r\n\r\n<h2>Hiện tại, Liver được đ&aacute;nh gi&aacute; nhỉnh hơn Man City.</h2>\r\n', 'Anh');
